CREATE TABLE INDIVIDUAIS (
    CODIGO          INTEIRO_VALIDO /* INTEIRO_VALIDO = INTEGER NOT NULL */,
    CODITEM         INTEIRO_VALIDO /* INTEIRO_VALIDO = INTEGER NOT NULL */,
    CODPRODUTO      INTEIRO_VALIDO /* INTEIRO_VALIDO = INTEGER NOT NULL */,
    CODMOVENTRADA   INTEIRO_VALIDO /* INTEIRO_VALIDO = INTEGER NOT NULL */,
    SEQUENCIA       STRSERIE_VALIDA /* STRSERIE_VALIDA = CHAR(4) DEFAULT '0000' NOT NULL */,
    SERIE           NUMSERIE_VALIDO /* NUMSERIE_VALIDO = CHAR(20) DEFAULT 'N/F' NOT NULL */,
    VENDIDO         SIMNAO /* SIMNAO = CHAR(1) DEFAULT 'N' NOT NULL CHECK (VALUE IN ('S', 'N')) */,
    CODMOVSAIDA     INTEIRO /* INTEIRO = INTEGER */,
    VALOR_VENDA     DINHEIRO /* DINHEIRO = NUMERIC(9,2) DEFAULT 0 NOT NULL */,
    ICMSVENDA       PORCENTO /* PORCENTO = NUMERIC(9,4) DEFAULT 0 NOT NULL */,
    DESCONTO        DINHEIRO3 /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    QUANTIDADE      DINHEIRO3 /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    VALOR_PAGO      NUMERIC(9,2) COMPUTED BY ((VALOR_VENDA - DESCONTO) * QUANTIDADE),
    VALOR_ICMS      DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    IMPETIQ         SIMNAO /* SIMNAO = CHAR(1) DEFAULT 'N' NOT NULL CHECK (VALUE IN ('S', 'N')) */,
    BARRA           BARRA_VALIDA /* BARRA_VALIDA = CHAR(14) DEFAULT '0000000000000' NOT NULL */,
    UNICO           INTEIRO_CHEIO1 /* INTEIRO_CHEIO1 = INTEGER DEFAULT 1 NOT NULL */,
    FRACIONADO      SIMNAO /* SIMNAO = CHAR(1) DEFAULT 'N' NOT NULL CHECK (VALUE IN ('S', 'N')) */,
    PS              PSM_REQDEF /* PSM_REQDEF = CHAR(1) DEFAULT 'P' CHECK (VALUE IN ('P', 'S', 'M')) */,
    CODEMPRESA      INTEIRO_CHEIO1 /* INTEIRO_CHEIO1 = INTEGER DEFAULT 1 NOT NULL */,
    VALOR_COMISSAO  DINHEIRO3 /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_PRODUTO   DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_IPI       DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_RATEIO    DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_ICMS      DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_COMISSAO  COMPUTED BY (VALOR_COMISSAO / QUANTIDADE),
    CUSTO_ISS       DINHEIRO3 NOT NULL /* DINHEIRO3 = DECIMAL(14,3) DEFAULT 0 NOT NULL */,
    CUSTO_TOTAL     COMPUTED BY (CUSTO_PRODUTO + CUSTO_IPI + CUSTO_RATEIO + CUSTO_COMISSAO + CUSTO_ICMS + CUSTO_ISS),
    TOTAL_IPI       COMPUTED BY (CUSTO_IPI * QUANTIDADE),
    TOTAL_ICMS      COMPUTED BY (CUSTO_ICMS * QUANTIDADE),
    TOTAL_ISS       COMPUTED BY (CUSTO_ISS * QUANTIDADE),
    TOTAL_CUSTO     COMPUTED BY (CUSTO_TOTAL * QUANTIDADE),
    TOTAL_LUCRO     COMPUTED BY (VALOR_PAGO - TOTAL_CUSTO),
    LUCRO_ITEM      COMPUTED BY (TOTAL_LUCRO / QUANTIDADE),
    NUMERO_FONE     STR20 /* STR20 = CHAR(20) */,
    CODOPERADORA    INTEIRO /* INTEIRO = INTEGER */,
    CODPLANO        INTEIRO /* INTEIRO = INTEGER */,
    REBATE          SIMNAO /* SIMNAO = CHAR(1) DEFAULT 'N' NOT NULL CHECK (VALUE IN ('S', 'N')) */,
    ATIVACAO        SIMNAO /* SIMNAO = CHAR(1) DEFAULT 'N' NOT NULL CHECK (VALUE IN ('S', 'N')) */,
    CODINDIVIDUO    INTEIRO /* INTEIRO = INTEGER */,
    APARELO         STR60 /* STR60 = CHAR(60) */,
    SERIE2          STR20 /* STR20 = CHAR(20) */,
    DATAENTRADA     DATA /* DATA = TIMESTAMP */,
    DATASAIDA       DATA /* DATA = TIMESTAMP */,
    TEMPOESTOQUE    DOUBLEPRES /* DOUBLEPRES = DOUBLE PRECISION */,
    CONTRATO        VSTR10 /* VSTR10 = VARCHAR(10) */,
    VOUCHER         VSTR20 /* VSTR20 = VARCHAR(10) */,
    TIPOATIVACAO    STR01 /* STR01 = CHAR(1) */,
    DESCONTO_ADM    DINHEIRO_VAZIO /* DINHEIRO_VAZIO = NUMERIC(9,2) */
);

