/* Trigger: CAIXAS_BI0 */
CREATE TRIGGER CAIXAS_BI0 FOR CAIXAS
ACTIVE BEFORE INSERT POSITION 0
AS
BEGIN
  IF (NEW.CODCAIXALAN = 0) THEN
    EXECUTE PROCEDURE SEQ_OBTER('CAIXAS')
      RETURNING_VALUES NEW.CODCAIXALAN;
  IF (NEW.CODPAGAMENTO IS NOT NULL) THEN
    SELECT
      DESCRICAO
    FROM
      PAGAMENTOS
    WHERE
      CODIGO = NEW.CODPAGAMENTO
    INTO
      NEW.DESCRICAO;
END
