/* Trigger: CLIENTES_VERIDOC */
CREATE TRIGGER CLIENTES_VERIDOC FOR CLIENTES
ACTIVE BEFORE INSERT POSITION 0
AS
DECLARE VARIABLE TESTE INTEGER;
BEGIN

  /* TESTO O CPF */
  SELECT
    1
  FROM
    CLIENTES
  WHERE
    CLIENTES.CPF = NEW.CPF
  INTO
    :TESTE;

  IF (TESTE = 1) THEN
    EXCEPTION CPF_CADASTRADO;

  /* TESTE DO CNPJ */
  SELECT
    1
  FROM
    CLIENTES
  WHERE
    CLIENTES.CGC = NEW.CGC
  INTO
    :TESTE;

  IF (TESTE = 1) THEN
    EXCEPTION CPF_CADASTRADO;

END
^

