/* Trigger: MOVIMENTOS_VENDEDOR_INS */
CREATE TRIGGER MOVIMENTOS_VENDEDOR_INS FOR MOVIMENTOS
ACTIVE BEFORE INSERT POSITION 0
AS
BEGIN

    /* SYNC */
    NEW.SYNC_SITE = 1;

    /* NOME DO VENDEDOR */
    SELECT
        NOME
    FROM
        CLIENTES
    WHERE
        CODIGO = NEW.CODVENDEDOR
    INTO
        NEW.NOME_VENDEDOR;

    /* TERRITORIO DA OS */
    SELECT FIRST 1
        CE.TERRITORIO
    FROM
        CLI_EQUIP CE
    WHERE
        CE.CODCLIENTE = NEW.CODCLIENTE AND
        CE.CODMARCA = NEW.CODMARCA AND
        CE.CODMODELO = NEW.CODMODELO AND
        CE.SERIE = NEW.SERIE
    INTO
        NEW.TERRITORIO;
END
^

