ALTER PROCEDURE ANALISE_DATA (
    DATA TIMESTAMP)
RETURNS (
    DATA_FLUXO DATE,
    DIA_FLUXO INTEGER,
    SEMANA_FLUXO INTEGER,
    MES_FLUXO INTEGER,
    BIMESTRE_FLUXO INTEGER,
    TRIMESTRE_FLUXO INTEGER,
    QUADRIMESTRE_FLUXO INTEGER,
    SEMESTRE_FLUXO INTEGER,
    ANO_FLUXO INTEGER,
    STR_SEMANA_FLUXO VARCHAR(30),
    STR_MES_FLUXO VARCHAR(20),
    STR_BIMESTRE_FLUXO VARCHAR(30),
    STR_TRIMESTRE_FLUXO VARCHAR(30),
    STR_QUADRIMESTRE_FLUXO VARCHAR(30),
    STR_SEMESTRE_FLUXO VARCHAR(30))
AS
DECLARE VARIABLE TEMP_SEMANA INTEGER;
DECLARE VARIABLE TEMP_DATA DATE;
BEGIN

  /* DATA FLUXO */
  DATA_FLUXO = CAST(DATA AS DATE);

  /* SE FOR SABADO, SOMO 1 DIA  */
  --IF (UDF_WEEKDAY(DATA_FLUXO) = 6) THEN
  --  DATA_FLUXO = DATA_FLUXO + 1;

  /* SE FOR DOMINGO, SOMO 1 DIA  PARA CAIR NA PROXIMA SEGUNDA */
  --IF (UDF_WEEKDAY(DATA_FLUXO) = 0) THEN
  --  DATA_FLUXO = DATA_FLUXO + 1;

  /* DIA FLUXO */
  DIA_FLUXO = EXTRACT(DAY FROM DATA_FLUXO);

  /* SEMANA FLUXO */
  /* DIA DA SEMANA DO PRIMEIRO DIA DO ANO */
  TEMP_DATA = UDF_ENCDATE(
      EXTRACT(YEAR FROM DATA_FLUXO),
      01,
      01);
  TEMP_SEMANA = UDF_WEEKDAY(TEMP_DATA);
  /* SE FOR DOMINGO OU SEGUNDA A SEMANA COMEÃA MAIS TARDE */
  IF (TEMP_SEMANA > 0) THEN
   BEGIN
     IF (TEMP_SEMANA = 6) THEN
       TEMP_DATA = TEMP_DATA + 1;
     ELSE
       TEMP_DATA = TEMP_DATA - TEMP_SEMANA;
   END
  /* DIFERENÃA ENTRE AS SEMANAS */
  SEMANA_FLUXO = CAST((DATA_FLUXO - TEMP_DATA) AS INTEGER) / 7;
  IF (SEMANA_FLUXO = 0) THEN
    SEMANA_FLUXO = 1;
  ELSE
    IF (UDF_MOD(CAST((DATA_FLUXO - TEMP_DATA) AS INTEGER), 7) > 0) THEN
      SEMANA_FLUXO = SEMANA_FLUXO + 1;

  /* MES */
  MES_FLUXO = EXTRACT(MONTH FROM DATA_FLUXO);

  /* BIMESTRE FLUXO */
  BIMESTRE_FLUXO = CAST((MES_FLUXO / 2) AS INTEGER);
  IF (BIMESTRE_FLUXO = 0) THEN
    BIMESTRE_FLUXO = 1;
  ELSE
    IF (UDF_MOD(MES_FLUXO, 2) > 0) THEN
      BIMESTRE_FLUXO = BIMESTRE_FLUXO + 1;

  /* TRIMESTRE FLUXO */
  TRIMESTRE_FLUXO = CAST((MES_FLUXO / 3) AS INTEGER);
  IF (TRIMESTRE_FLUXO = 0) THEN
    TRIMESTRE_FLUXO = 1;
  ELSE
    IF (UDF_MOD(MES_FLUXO, 3) > 0) THEN
      TRIMESTRE_FLUXO = TRIMESTRE_FLUXO + 1;

  /* QUADRIMESTRE FLUXO */
  QUADRIMESTRE_FLUXO = CAST((MES_FLUXO / 4) AS INTEGER);
  IF (QUADRIMESTRE_FLUXO = 0) THEN
    QUADRIMESTRE_FLUXO = 1;
  ELSE
    IF (UDF_MOD(MES_FLUXO, 4) > 0) THEN
      QUADRIMESTRE_FLUXO = QUADRIMESTRE_FLUXO + 1;

  /* SEMESTRE FLUXO */
  SEMESTRE_FLUXO = CAST((MES_FLUXO / 6) AS INTEGER);
  IF (SEMESTRE_FLUXO = 0) THEN
    QUADRIMESTRE_FLUXO = 1;
  ELSE
    IF (UDF_MOD(MES_FLUXO, 6) > 0) THEN
      SEMESTRE_FLUXO = SEMESTRE_FLUXO + 1;

  /* ANO FLUXO */
  ANO_FLUXO = EXTRACT(YEAR FROM DATA_FLUXO);

  /* STR SEMANA */
  TEMP_SEMANA = UDF_WEEKDAY(DATA_FLUXO);
  TEMP_DATA = DATA_FLUXO - TEMP_SEMANA;
  STR_SEMANA_FLUXO = UDF_PADL(EXTRACT(DAY FROM TEMP_DATA), '0', 2) || '/' ||
    UDF_PADL(EXTRACT(MONTH FROM TEMP_DATA), '0', 2) || '/' ||
    EXTRACT(YEAR FROM TEMP_DATA);
  TEMP_DATA = TEMP_DATA + 6;
  STR_SEMANA_FLUXO = STR_SEMANA_FLUXO || ' - ' ||
    UDF_PADL(EXTRACT(DAY FROM TEMP_DATA), '0', 2) || '/' ||
    UDF_PADL(EXTRACT(MONTH FROM TEMP_DATA), '0', 2) || '/' ||
    EXTRACT(YEAR FROM TEMP_DATA);

  /* STR MES */
  IF (MES_FLUXO = 1) THEN
    STR_MES_FLUXO = 'JANEIRO';
  ELSE IF (MES_FLUXO = 2) THEN
    STR_MES_FLUXO = 'FEVEREIRO';
  ELSE IF (MES_FLUXO = 3) THEN
    STR_MES_FLUXO = 'MARÃO';
  ELSE IF (MES_FLUXO = 4) THEN
    STR_MES_FLUXO = 'ABRIL';
  ELSE IF (MES_FLUXO = 5) THEN
    STR_MES_FLUXO = 'MAIO';
  ELSE IF (MES_FLUXO = 6) THEN
    STR_MES_FLUXO = 'JUNHO';
  ELSE IF (MES_FLUXO = 7) THEN
    STR_MES_FLUXO = 'JULHO';
  ELSE IF (MES_FLUXO = 8) THEN
    STR_MES_FLUXO = 'AGOSTO';
  ELSE IF (MES_FLUXO = 9) THEN
    STR_MES_FLUXO = 'SETEMBRO';
  ELSE IF (MES_FLUXO = 10) THEN
    STR_MES_FLUXO = 'OUTUBRO';
  ELSE IF (MES_FLUXO = 11) THEN
    STR_MES_FLUXO = 'NOVEMBRO';
  ELSE IF (MES_FLUXO = 12) THEN
    STR_MES_FLUXO = 'DEZEMBRO';

  /* STR BIMESTRE */
  IF (BIMESTRE_FLUXO = 1) THEN
    STR_BIMESTRE_FLUXO = 'JANEIRO - FEVEREIRO';
  ELSE IF (BIMESTRE_FLUXO = 2) THEN
    STR_BIMESTRE_FLUXO = 'MARÃO - ABRIL';
  ELSE IF (BIMESTRE_FLUXO = 3) THEN
    STR_BIMESTRE_FLUXO = 'MAIO - JUNHO';
  ELSE IF (BIMESTRE_FLUXO = 4) THEN
    STR_BIMESTRE_FLUXO = 'JULHO - AGOSTO';
  ELSE IF (BIMESTRE_FLUXO = 5) THEN
    STR_BIMESTRE_FLUXO = 'SETEMBRO - OUTUBRO';
  ELSE IF (BIMESTRE_FLUXO = 6) THEN
    STR_BIMESTRE_FLUXO = 'NOVEMBRO - DEZEMBRO';

  /* STR TRIMESTRE */
  IF (TRIMESTRE_FLUXO = 1) THEN
    STR_TRIMESTRE_FLUXO = 'JANEIRO - MARÃO';
  ELSE IF (TRIMESTRE_FLUXO = 2) THEN
    STR_TRIMESTRE_FLUXO = 'ABRIL - JUNHO';
  ELSE IF (TRIMESTRE_FLUXO = 3) THEN
    STR_TRIMESTRE_FLUXO = 'JULHO - SETEMBRO';
  ELSE IF (TRIMESTRE_FLUXO = 2) THEN
    STR_TRIMESTRE_FLUXO = 'OUTUBRO - DEZEMBRO';

  /* STR QUADRIMESTRE */
  IF (QUADRIMESTRE_FLUXO = 1) THEN
    STR_QUADRIMESTRE_FLUXO = 'JANEIRO - ABRIL';
  ELSE IF (QUADRIMESTRE_FLUXO = 2) THEN
    STR_QUADRIMESTRE_FLUXO = 'MAIO - AGOSTO';
  ELSE IF (QUADRIMESTRE_FLUXO = 3) THEN
    STR_QUADRIMESTRE_FLUXO = 'SETEMBRO - DEZEMBRO';

  /* STR SEMESTRE */
  IF (SEMESTRE_FLUXO = 1) THEN
    STR_SEMESTRE_FLUXO = 'JANEIRO - JUNHO';
  ELSE IF (SEMESTRE_FLUXO = 2) THEN
    STR_SEMESTRE_FLUXO = 'JULHO - DEZEMBRO';

  SUSPEND;

END^


ALTER PROCEDURE ATIVACAO_GRAVAR (
    CODATIVACAO INTEGER,
    CODAPARELHO INTEGER,
    APARELHO VARCHAR(60),
    SERIE VARCHAR(30),
    SERIE2 VARCHAR(30),
    NUMERO VARCHAR(20),
    CODOPERADORA INTEGER,
    CODPLANO INTEGER,
    CONTRATO VARCHAR(10),
    VOUCHER VARCHAR(20),
    TIPOATIVACAO CHAR(1),
    REBATE CHAR(1),
    DESCONTO_ADM NUMERIC(9,2))
AS
BEGIN

  IF (CODATIVACAO IS NOT NULL) THEN
    UPDATE
      INDIVIDUAIS ID
    SET
      ID.CODINDIVIDUO = :CODAPARELHO,
      ID.APARELO      = :APARELHO,
      ID.SERIE        = :SERIE,
      ID.SERIE2       = :SERIE2,
      ID.NUMERO_FONE  = :NUMERO,
      ID.CODOPERADORA = :CODOPERADORA,
      ID.CODPLANO     = :CODPLANO,
      ID.REBATE       = :REBATE,
      ID.CONTRATO     = :CONTRATO,
      ID.VOUCHER      = :VOUCHER,
      ID.TIPOATIVACAO = :TIPOATIVACAO,
      ID.ATIVACAO     = 'S',
      ID.DESCONTO_ADM = :DESCONTO_ADM
    WHERE
      ID.CODIGO       = :CODATIVACAO;

END^


ALTER PROCEDURE ATIVACAO_LER (
    CODMOVIMENTO INTEGER)
RETURNS (
    CODATIVACAO INTEGER,
    CODAPARELHO INTEGER,
    APARELHO VARCHAR(60),
    SERIE VARCHAR(30),
    SERIE2 VARCHAR(30),
    NUMERO VARCHAR(20),
    CODOPERADORA INTEGER,
    CODPLANO INTEGER,
    VALOR1 NUMERIC(9,2),
    VALOR2 NUMERIC(9,2),
    REBATE CHAR(1),
    CONTRATO VARCHAR(10),
    VOUCHER VARCHAR(20),
    TIPOATIVACAO CHAR(1),
    DESCONTO_ADM NUMERIC(9,2))
AS
DECLARE VARIABLE DESCRICAO VARCHAR(60);
BEGIN

  /* APARELHO */
  SELECT FIRST 1
    ID.CODIGO,
    PO.CODIGO,
    ID.APARELO,
    PO.DESCRICAO,
    PO.PRECOVENDA,
    ID.VALOR_PAGO,
    ID.SERIE,
    ID.SERIE2,
    ID.NUMERO_FONE,
    ID.CODOPERADORA,
    ID.CODPLANO,
    ID.CONTRATO,
    ID.VOUCHER,
    ID.TIPOATIVACAO,
    ID.DESCONTO_ADM
  FROM
    INDIVIDUAIS ID
    JOIN PRODUTOS PO ON
      (PO.CODIGO = ID.CODPRODUTO)
    JOIN PRODUTOS SE ON
      (SE.CODIGO = PO.CODSERVICO)
  WHERE
    ID.CODMOVSAIDA = :CODMOVIMENTO AND
    ID.PS = 'P' AND
    ID.VENDIDO = 'S' AND
    ID.UNICO = 1 AND
    SE.ATIVACAO = 'S'
  INTO
    :CODATIVACAO,
    :CODAPARELHO,
    :APARELHO,
    :DESCRICAO,
    :VALOR1,
    :VALOR2,
    :SERIE,
    :SERIE2,
    :NUMERO,
    :CODOPERADORA,
    :CODPLANO,
    :CONTRATO,
    :VOUCHER,
    :TIPOATIVACAO,
    :DESCONTO_ADM;

  IF ((APARELHO IS NULL) AND (DESCRICAO IS NOT NULL)) THEN
    APARELHO = DESCRICAO;

  IF (VALOR1 <> VALOR2) THEN
    REBATE = 'S';
  ELSE
    REBATE = 'N';

  IF (CODATIVACAO IS NOT NULL) THEN
    SUSPEND;

END^


ALTER PROCEDURE AUTOBAIXA (
    CODMOVIMENTO INTEGER)
AS
DECLARE VARIABLE CODDOC_AVISTA INTEGER;
DECLARE VARIABLE CODIGO INTEGER;
DECLARE VARIABLE CODDOCUMENTO INTEGER;
DECLARE VARIABLE DATAVENCIMENTO TIMESTAMP;
DECLARE VARIABLE PAGO INTEGER;
DECLARE VARIABLE PARCELA_TOTAL DOUBLE PRECISION;
DECLARE VARIABLE MOVIMENTO_TOTAL DOUBLE PRECISION;
DECLARE VARIABLE XPARC INTEGER;
DECLARE VARIABLE CODEMPRESA INTEGER;
DECLARE VARIABLE CODCONTA INTEGER;
DECLARE VARIABLE NOMEUSER VARCHAR(30);
DECLARE VARIABLE VALOR NUMERIC(14,3);
DECLARE VARIABLE CODCAIXALAN INTEGER;
DECLARE VARIABLE TIPOPAG CHAR(1);
DECLARE VARIABLE CAIXA CHAR(1);
DECLARE VARIABLE TECNICOLOGIN CHAR(1);
BEGIN
  /* VERIFICO SE OS VALORES SAO CORRESPONDENTES */
  SELECT
    COUNT(PA.CODIGO),
    SUM(PA.VALOR)
  FROM
    PAGAMENTOS PA
  WHERE
    PA.CODMOVIMENTO = :CODMOVIMENTO
  INTO
    :XPARC,
    :PARCELA_TOTAL;

  IF (XPARC IS NULL) THEN
    XPARC = 0;

  /* VALOR DAS PARCELAS DEVE SER IGUAL OU SUPERIOR AO VALOR DO FATURAMENTO */
  IF (MOVIMENTO_TOTAL > PARCELA_TOTAL) THEN
    EXCEPTION VALOR_PARCELA;

  /* APOS FECHADO, MOSTRO AS PARCELAS */
  UPDATE
    PAGAMENTOS
  SET
    ES = 2
  WHERE
    CODMOVIMENTO = :CODMOVIMENTO;

  /* QUAL Ã O DOCUMENTO A VISTA? */
  SELECT
    CODDOC_AVISTA
  FROM
    SISCONFIG
  WHERE
    CODIGO = :CODEMPRESA
  INTO
    :CODDOC_AVISTA;

  /* PROCURO OS PAGAMENTOS, ALGUM Ã A VISTA? */
  FOR
  SELECT
    PA.CODIGO,
    PA.CODDOCUMENTO,
    PA.DATAVENCIMENTO,
    PA.PAGO,
    PA.CODCONTA,
    PA.VALOR,
    DC.TIPO_PAG
  FROM
    PAGAMENTOS PA
    JOIN DOCUMENTOS DC ON
      (DC.CODIGO = PA.CODDOCUMENTO)
  WHERE
    CODMOVIMENTO = :CODMOVIMENTO
  INTO
    :CODIGO,
    :CODDOCUMENTO,
    :DATAVENCIMENTO,
    :PAGO,
    :CODCONTA,
    :VALOR,
    :TIPOPAG
  DO
  BEGIN

   /* O DOCUMENTO Ã A VISTA? */
   IF ((TIPOPAG = 'A') AND (PAGO = 0)) THEN
    BEGIN

      /* FAÃO O LANÃAMENTO */
     EXECUTE PROCEDURE BAIXA(
       :CODIGO,
       0,
       0,
       'T',
       :CODCONTA,
       :CODDOCUMENTO,
       '',
       :NOMEUSER);

    END

  END

END^


ALTER PROCEDURE BAIXA (
    CODIGO INTEGER,
    MULTA_JUROS NUMERIC(14,3),
    DESCONTO NUMERIC(14,3),
    TIPO CHAR(1),
    CONTA INTEGER,
    CODDOCUMENTO INTEGER,
    INFODOC VARCHAR(50),
    NOMEUSER VARCHAR(30))
AS
declare variable codmovimento integer;
declare variable descricao varchar(40);
declare variable es integer;
declare variable valor numeric(14,3);
declare variable datavencimento timestamp;
declare variable novonum numeric(15,2);
declare variable codempresa integer;
declare variable codcliente integer;
declare variable codcentro integer;
declare variable codplano integer;
declare variable tipop char(1);
BEGIN

    /* VERIFICO SE CLIENTE ESTÃ PROTESTADO EM CARTÃRIO */
    SELECT
      CL.TIPO_IMPEDIMENTO
    FROM
      CLIENTES CL
      JOIN PAGAMENTOS PA ON
        (PA.CODCLIENTE = CL.CODIGO)
    WHERE
      PA.CODIGO = :CODIGO
    INTO
      :TIPOP;

    /* NÃO RECEBER */
    IF (TIPOP = 'P') THEN
      EXCEPTION PROTESTO_CARTORIO;

    /* Ã UMA BAIXA PARCIAL */
    IF ((TIPO = 'P') AND (DESCONTO > 0)) THEN
     BEGIN

       /* VALOR REAL */
       SELECT
         VALOR
       FROM
         PAGAMENTOS
       WHERE
         CODIGO = :CODIGO
       INTO
         :VALOR;

       /* FAÃO A BAIXA */
       UPDATE
         PAGAMENTOS
       SET
         PAGO = 1,
         MULTA_JUROS = :MULTA_JUROS,
         VALOR = (:VALOR - :DESCONTO),
         CODCONTA = :CONTA,
         CODDOCUMENTO = :CODDOCUMENTO,
         INFODOC = :INFODOC,
         NOMEUSUARIO = :NOMEUSER
       WHERE
         CODIGO = :CODIGO;

       /* VALOR RESTANTE */
       VALOR = DESCONTO;

       /* LEIO OS DADOS DO PAGAMENTO */
       SELECT
         CODMOVIMENTO,
         UDF_LEFT(DESCRICAO, 35),
         ES,
         DATAVENCIMENTO,
         CODEMPRESA,
         CODCLIENTE,
         CODCENTRO,
         CODPLANO
       FROM
         PAGAMENTOS
       WHERE
         CODIGO = :CODIGO
       INTO
         :CODMOVIMENTO,
         :DESCRICAO,
         :ES,
         :DATAVENCIMENTO,
         :CODEMPRESA,
         :CODCLIENTE,
         :CODCENTRO,
         :CODPLANO;

       /* PEGO O PROXIMO CODIGO */
       SELECT
         SEQUENCIA
       FROM
         SEQ_OBTER('PAGAMENTOS')
       INTO
         :CODIGO;

       /* ACERTO A DESCRICAO */
       DESCRICAO = 'ADIC ' || DESCRICAO;

       /* PEGO O NUMERO NOVO */
       SELECT
         MAX(NUMERO) + 1
       FROM
         PAGAMENTOS
       WHERE
         CODMOVIMENTO = :CODMOVIMENTO
       INTO
         :NOVONUM;

       /* NUMERO */
       IF (NOVONUM IS NULL) THEN
         NOVONUM = 1;

       /* INSIRO O PAGAMENTO RESTANTE */
         PAGAMENTOS (
           CODIGO,
           CODMOVIMENTO,
           NUMERO,
           DESCRICAO,
           ES,
           DATACADAST,
           VALOR,
           EXTERNO,
           PAGO,
           DESCONTO,
           MULTA_JUROS,
           DATAVENCIMENTO,
           SALDOANT,
           SALDOATU,
           CODCONTA,
           CODDOCUMENTO,
           CODEMPRESA,
           CODCLIENTE,
           CODCENTRO,
           CODPLANO)
         VALUES (
           :CODIGO,
           :CODMOVIMENTO,
           :NOVONUM,
           :DESCRICAO,
           :ES,
           'NOW',
           :VALOR,
           'S',
           0,
           0,
           0,
           :DATAVENCIMENTO,
           0,
           0,
           :CONTA,
           :CODDOCUMENTO,
           :CODEMPRESA,
           :CODCLIENTE,
           :CODCENTRO,
           :CODPLANO);

     END ELSE
     BEGIN

       /* FAÃO A BAIXA TOTAL */
       UPDATE
         PAGAMENTOS
       SET
         PAGO = 1,
         MULTA_JUROS = :MULTA_JUROS,
         DESCONTO = :DESCONTO,
         CODCONTA = :CONTA,
         CODDOCUMENTO = :CODDOCUMENTO,
         INFODOC = :INFODOC,
         NOMEUSUARIO = :NOMEUSER
       WHERE
         CODIGO = :CODIGO;

     END
END^


ALTER PROCEDURE BAIXAMULT (
    CODCLIENTE INTEGER,
    MOVCOM VARCHAR(254),
    ACRESCIMOS NUMERIC(14,3),
    DESCONTOS NUMERIC(14,3),
    CODCONTA INTEGER,
    USUARIO VARCHAR(30))
AS
DECLARE VARIABLE N NUMERIC(14,3);
DECLARE VARIABLE ACRESCIMO_PARCIAL NUMERIC(14,3);
DECLARE VARIABLE CODMOVIMENTO INTEGER;
DECLARE VARIABLE NUMERO INTEGER;
DECLARE VARIABLE CODIGO INTEGER;
DECLARE VARIABLE CODPAG INTEGER;
DECLARE VARIABLE INFODOC VARCHAR(50);
DECLARE VARIABLE TOTAL_PAGO NUMERIC(14,3);
DECLARE VARIABLE CODDOCUMENTO INTEGER;
BEGIN

  /* USUARIO */
  IF ((USUARIO IS NULL) OR (USUARIO = '')) THEN
    USUARIO = USER;

  /* NUMERO DE BAIXAS */
  SELECT
    COUNT(*)
  FROM
    PARSER_PAGAMENTOS(:MOVCOM)
  INTO
    :N;

  /* SE HOUVER ACRESCIMOS */
  ACRESCIMO_PARCIAL = 0;
  IF (ACRESCIMOS > 0) THEN
    ACRESCIMO_PARCIAL = ACRESCIMOS / N;

  /* PROCESSO AS BAIXAS */
  FOR
  SELECT
    CODIGO,
    CODMOVIMENTO,
    NUMERO
  FROM
    PARSER_PAGAMENTOS(:MOVCOM)
  INTO
    :CODIGO,
    :CODMOVIMENTO,
    :NUMERO
  DO
  BEGIN

    IF (CODMOVIMENTO IS NULL) THEN
     BEGIN

       SELECT
         CODIGO,
         INFODOC,
         TOTAL_PAGO,
         CODDOCUMENTO
       FROM
         PAGAMENTOS
       WHERE
         CODIGO = :CODIGO AND
         PAGO = 0 AND
         ES IN (1, 2) AND
         CODCLIENTE = :CODCLIENTE
       INTO
         :CODPAG,
         :INFODOC,
         :TOTAL_PAGO,
         :CODDOCUMENTO;

     END ELSE
     BEGIN

       SELECT
         CODIGO,
         INFODOC,
         TOTAL_PAGO,
         CODDOCUMENTO
       FROM
         PAGAMENTOS
       WHERE
         CODMOVIMENTO = :CODMOVIMENTO AND
         NUMERO = :NUMERO AND
         PAGO = 0 AND
         ES IN (1, 2) AND
         CODCLIENTE = :CODCLIENTE
       INTO
         :CODPAG,
         :INFODOC,
         :TOTAL_PAGO,
         :CODDOCUMENTO;

     END

    /* BAIXA TOTAL OU PARCIAL ?? */
    IF ((N = 1) AND (DESCONTOS > 0)) THEN
     BEGIN

       /* BAIXA PARCIAL */
       EXECUTE PROCEDURE BAIXA(
         :CODPAG,
         :ACRESCIMO_PARCIAL,
         :TOTAL_PAGO - :DESCONTOS,
         'P',
         :CODCONTA,
         :CODDOCUMENTO,
         :INFODOC,
         :USUARIO);

     END ELSE
     BEGIN

       /* BAIXA TOTAL */
       EXECUTE PROCEDURE BAIXA(
         :CODPAG,
         :ACRESCIMO_PARCIAL,
         0,
         'T',
         :CODCONTA,
         :CODDOCUMENTO,
         :INFODOC,
         :USUARIO);

     END
  END
END^


