ALTER PROCEDURE CALC_ICMS (
    CODMOVIMENTO INTEGER)
RETURNS (
    VALOR_ICMS NUMERIC(9,2),
    VALOR_IPI NUMERIC(9,2),
    BASE_ICMS NUMERIC(9,2))
AS
DECLARE VARIABLE CALC_BASEICMS CHAR(1);
DECLARE VARIABLE VALOR_PAGO NUMERIC(9,2);
DECLARE VARIABLE IPI NUMERIC(9,2);
DECLARE VARIABLE XIPI CHAR(1);
DECLARE VARIABLE TEMP_CODPRODUTO INTEGER;
DECLARE VARIABLE TEMP_VALORPAGO NUMERIC(9,2);
DECLARE VARIABLE TEMP_BASEICMS NUMERIC(9,2);
DECLARE VARIABLE TEMP_VALORICMS NUMERIC(9,2);
BEGIN
  VALOR_IPI = 0;
  VALOR_ICMS = 0;
  VALOR_PAGO = 0;
  BASE_ICMS = 0;

  SELECT
    CL.CALC_BASEICMS
  FROM
    CLIENTES CL
    JOIN MOVIMENTOS MO ON
      (MO.CODCLIENTE = CL.CODIGO)
  WHERE
    MO.CODIGO = :CODMOVIMENTO
  INTO
    :CALC_BASEICMS;

  IF (CALC_BASEICMS = 'S') THEN
   BEGIN

     FOR
     SELECT
       ID.CODPRODUTO,
       SUM(ID.VALOR_PAGO),
       (SUM(ID.VALOR_PAGO) * PO.ICMS_BASE) / 100,
       CAST(((((SUM(ID.VALOR_PAGO) * PO.ICMS_BASE) / 100) * PO.ICMS) / 100) AS NUMERIC(9,2))
     FROM
       INDIVIDUAIS ID
       JOIN PRODUTOS PO ON
         (PO.CODIGO = ID.CODPRODUTO)
     WHERE
       ID.CODMOVSAIDA = :CODMOVIMENTO AND
       ID.VENDIDO = 'S' AND
       ID.PS = 'P'
     GROUP BY
       CODPRODUTO,
       PO.ICMS,
       PO.ICMS_BASE
     INTO
       :TEMP_CODPRODUTO,
       :TEMP_VALORPAGO,
       :TEMP_BASEICMS,
       :TEMP_VALORICMS
     DO
     BEGIN
       VALOR_ICMS = VALOR_ICMS + TEMP_VALORICMS;
       VALOR_PAGO = VALOR_PAGO + TEMP_VALORPAGO;
       BASE_ICMS  = BASE_ICMS  + TEMP_BASEICMS;
     END

   END ELSE
   BEGIN

     FOR
     SELECT
       ID.CODPRODUTO,
       SUM(ID.VALOR_PAGO),
       SUM(ID.VALOR_PAGO),
       CAST((SUM(ID.VALOR_PAGO) * (PO.ICMS / 100)) AS NUMERIC(9,2))
     FROM
       INDIVIDUAIS ID
       JOIN PRODUTOS PO ON
         (PO.CODIGO = ID.CODPRODUTO)
     WHERE
       ID.CODMOVSAIDA = :CODMOVIMENTO AND
       ID.VENDIDO = 'S' AND
       ID.PS = 'P'
     GROUP BY
       CODPRODUTO,
       PO.ICMS,
       PO.ICMS_BASE
     INTO
       :TEMP_CODPRODUTO,
       :TEMP_VALORPAGO,
       :TEMP_BASEICMS,
       :TEMP_VALORICMS
     DO
     BEGIN
       VALOR_ICMS = VALOR_ICMS + TEMP_VALORICMS;
       VALOR_PAGO = VALOR_PAGO + TEMP_VALORPAGO;
       BASE_ICMS  = BASE_ICMS  + TEMP_BASEICMS;
     END

   END

  VALOR_IPI = VALOR_PAGO * (IPI / 100);

  /* VERIFICO IPI */
  SELECT
    NA.IPI
  FROM
    NATUOPER NA
    JOIN MOVIMENTOS MO ON
      (MO.NOTA_CODNATUOPER = NA.CODIGO)
  WHERE
    MO.CODIGO = :CODMOVIMENTO
  INTO
    :XIPI;

  IF (XIPI IS NULL) THEN
    XIPI = 'N';

  IF ((VALOR_IPI IS NULL) OR (XIPI = 'N')) THEN
    VALOR_IPI = 0;

  IF (VALOR_ICMS IS NULL) THEN
    VALOR_ICMS = 0;

  SUSPEND;
END^


ALTER PROCEDURE COMISSAO_CALC (
    CODMOVIMENTO INTEGER)
AS
DECLARE VARIABLE VALOR_TOTAL NUMERIC(9,2);
DECLARE VARIABLE PERCCOMIS_CALCULO CHAR(1);
DECLARE VARIABLE PERCCOMIS_PROD NUMERIC(9,2);
DECLARE VARIABLE PERCCOMIS_PECA NUMERIC(9,2);
DECLARE VARIABLE PERCCOMIS_SERV NUMERIC(9,2);
DECLARE VARIABLE CLIENTE_COMISSIONADO CHAR(1);
DECLARE VARIABLE CODVENDEDOR INTEGER;
DECLARE VARIABLE ES INTEGER;
DECLARE VARIABLE TIPO INTEGER;
DECLARE VARIABLE ITEM_TIPO CHAR(1);
DECLARE VARIABLE ITEM_PS CHAR(1);
DECLARE VARIABLE ITEM_VALOR NUMERIC(9,2);
DECLARE VARIABLE SOMA_PROD NUMERIC(9,2);
DECLARE VARIABLE SOMA_PECA NUMERIC(9,2);
DECLARE VARIABLE SOMA_SERV NUMERIC(9,2);
DECLARE VARIABLE CODTECNICO INTEGER;
DECLARE VARIABLE PERC_TECNICO NUMERIC(9,2);
BEGIN

  /* INICIALIZAÃÃO */
  SOMA_PROD          = 0;
  SOMA_PECA          = 0;
  SOMA_SERV          = 0;
  PERCCOMIS_PROD     = 0;
  PERCCOMIS_PECA     = 0;
  PERCCOMIS_SERV     = 0;

  /* DADOS PARA COMISSIONAR */
  SELECT
    CAST(MO.NOTA_VALOR_TOTAL AS DECIMAL(9, 2)),
    MO.CODVENDEDOR,
    MO.ES,
    MO.TIPO,
    CL.PERCCOMIS_CALCULO,
    CI.COMISSIONADO
  FROM
    MOVIMENTOS MO
    LEFT JOIN CLIENTES CL ON
      (CL.CODIGO = MO.CODVENDEDOR)
    LEFT JOIN CLIENTES CI ON
      (CI.CODIGO = MO.CODCLIENTE)
  WHERE
    MO.CODIGO = :CODMOVIMENTO
  INTO
    :VALOR_TOTAL,
    :CODVENDEDOR,
    :ES,
    :TIPO,
    :PERCCOMIS_CALCULO,
    :CLIENTE_COMISSIONADO;

  /* MOVIMENTO Ã COMISSIONÃVEL ?? */
  IF (NOT ((ES = 2) AND (TIPO IN (3, 6)))) THEN
    EXIT;

  /* CLIENTE Ã COMISSIONADO */
  IF (CLIENTE_COMISSIONADO = 'S') THEN
   BEGIN

     /* PROCURO PRODUTOS E SERVICOS VENDIDOS */
     FOR
     SELECT
       PO.TIPOPRODUTO,
       ID.PS,
       SUM(ID.VALOR_PAGO)
     FROM
       PRODUTOS PO
       LEFT JOIN INDIVIDUAIS ID ON
         (ID.CODPRODUTO = PO.CODIGO)
     WHERE
       PO.COMISSIONADO = 'S' AND
       ID.CODMOVSAIDA = :CODMOVIMENTO AND
       ID.VENDIDO = 'S'
     GROUP BY
       PO.TIPOPRODUTO,
       ID.PS
     INTO
       :ITEM_TIPO,
       :ITEM_PS,
       :ITEM_VALOR
     DO
     BEGIN

       /* PROTEÃÃO */
       IF (ITEM_VALOR IS NULL) THEN
         ITEM_VALOR = 0;

       /* PRODUTO OU SERVICO ?? */
       IF (ITEM_PS = 'S') THEN
        BEGIN

          /* SERVIÃO SOMA PARA TECNICOS */
          SOMA_SERV = SOMA_SERV + ITEM_VALOR;

        END ELSE
        BEGIN

          /* PEÃA OU PRODUTO ?? */
          IF (ITEM_TIPO = 'F') THEN
           BEGIN

             /* PRODUTO FINAL SOMA PARA VENDEDOR */
             SOMA_PROD = SOMA_PROD + ITEM_VALOR;

           END ELSE
           BEGIN

             /* PEÃA DE REPOSIÃÃO SOMA PARA TECNICO */
             SOMA_PECA = SOMA_PECA + ITEM_VALOR;

           END

        END

     END

     /* CALCULO AS PORCENTAGENS */
     IF (VALOR_TOTAL > 0) THEN
      BEGIN
        PERCCOMIS_PROD = ((SOMA_PROD * 100) / VALOR_TOTAL);
        PERCCOMIS_PECA = ((SOMA_PECA * 100) / VALOR_TOTAL);
        PERCCOMIS_SERV = ((SOMA_SERV * 100) / VALOR_TOTAL);
      END ELSE
      BEGIN
        PERCCOMIS_PROD = 0;
        PERCCOMIS_PECA = 0;
        PERCCOMIS_SERV = 0;
      END

     /* COMISSIONAMENTO NO FATURAMENTO */
     IF (PERCCOMIS_CALCULO = 'F') THEN
      BEGIN

        /* LANÃAMENTO DE COMISSÃO PARA VENDEDOR */
          COMISSOES (
            CODMOVIMENTO,
            CODVENDEDOR,
            DATA,
            CODPAGAMENTO,
            DESCRICAO,
            PERCCOMIS_CALCULO,
            VALOR,
            TIPOPRODUTO,
            PERCENTUAL)
          VALUES (
            :CODMOVIMENTO,
            :CODVENDEDOR,
            'NOW',
            NULL,
            'VENDEDOR PRODUTOS FATURAMENTO',
            :PERCCOMIS_CALCULO,
            :SOMA_PROD,
            'F',
            0);

        /* LANÃAMENTO DE COMISSÃO PARA TÃCNICOS */
        FOR
        SELECT
          OS.CODVENDEDOR,
          OS.PORCENTAGEM
        FROM
          OS_VENDER OS
        WHERE
          OS.CODMOVIMENTO = :CODMOVIMENTO
        INTO
          :CODTECNICO,
          :PERC_TECNICO
        DO
        BEGIN

          /* LANÃAMENTO SERVIÃOS PARA UM TECNICO */
            COMISSOES (
              CODMOVIMENTO,
              CODVENDEDOR,
              DATA,
              CODPAGAMENTO,
              DESCRICAO,
              PERCCOMIS_CALCULO,
              VALOR,
              TIPOPRODUTO,
              PERCENTUAL)
            VALUES (
              :CODMOVIMENTO,
              :CODTECNICO,
              'NOW',
              NULL,
              'TECNICO SERVICOS FATURAMENTO',
              :PERCCOMIS_CALCULO,
              ((:SOMA_SERV * :PERC_TECNICO) / 100),
              'S',
              0);

          /* LANÃAMENTO PEÃAS PARA UM TECNICO */
            COMISSOES (
              CODMOVIMENTO,
              CODVENDEDOR,
              DATA,
              CODPAGAMENTO,
              DESCRICAO,
              PERCCOMIS_CALCULO,
              VALOR,
              TIPOPRODUTO,
              PERCENTUAL)
            VALUES (
              :CODMOVIMENTO,
              :CODTECNICO,
              'NOW',
              NULL,
              'TECNICO PECAS FATURAMENTO',
              :PERCCOMIS_CALCULO,
              ((:SOMA_PECA * :PERC_TECNICO) / 100),
              'C',
              0);

        END

      END

   END ELSE
   BEGIN

     /* LANCAMENTO DO AVISO DE CLIENTE NÃO COMISSIONADO PARA VENDEDOR */
       COMISSOES (
         CODMOVIMENTO,
         CODVENDEDOR,
         DATA,
         CODPAGAMENTO,
         DESCRICAO,
         PERCCOMIS_CALCULO,
         VALOR,
         TIPOPRODUTO,
         PERCENTUAL)
       VALUES (
         :CODMOVIMENTO,
         :CODVENDEDOR,
         'NOW',
         NULL,
         'CLIENTE NAO RENDE COMISSIONAMENTO',
         :PERCCOMIS_CALCULO,
         0,
         'F',
         0);

     /* LANÃAMENTO DE COMISSÃO PARA TÃCNICOS */
     FOR
     SELECT
       OS.CODVENDEDOR,
       OS.PORCENTAGEM
     FROM
       OS_VENDER OS
     WHERE
       OS.CODMOVIMENTO = :CODMOVIMENTO
     INTO
       :CODTECNICO,
       :PERC_TECNICO
     DO
     BEGIN

       /* LANÃAMENTO PARA UM TECNICO */
         COMISSOES (
           CODMOVIMENTO,
           CODVENDEDOR,
           DATA,
           CODPAGAMENTO,
           DESCRICAO,
           PERCCOMIS_CALCULO,
           VALOR,
           TIPOPRODUTO,
           PERCENTUAL)
         VALUES (
           :CODMOVIMENTO,
           :CODTECNICO,
           'NOW',
           NULL,
           'CLIENTE NAO RENDE COMISSIONAMENTO',
           :PERCCOMIS_CALCULO,
           0,
           'S',
           0);

     END

   END

  /* GRAVO DADOS APURADOS NO MOVIMENTO PARA FUTURA CONSULTA */
  UPDATE
    MOVIMENTOS
  SET
    PERCCOMIS_CALCULO   = :PERCCOMIS_CALCULO,
    PERCCOMIS_PROD = :PERCCOMIS_PROD,
    PERCCOMIS_PECA = :PERCCOMIS_PECA,
    PERCCOMIS_SERV = :PERCCOMIS_SERV
  WHERE
    CODIGO = :CODMOVIMENTO;

END^


