ALTER PROCEDURE FINANC_ESTORNO (
    CODIGO INTEGER,
    CODUSUARIO INTEGER)
AS
DECLARE VARIABLE PAGO INTEGER;
DECLARE VARIABLE TEMP_CODMOVIMENTO INTEGER;
DECLARE VARIABLE TEMP_NUMERO INTEGER;
DECLARE VARIABLE TEMP_DESCRICAO VARCHAR(40);
DECLARE VARIABLE TEMP_ES INTEGER;
DECLARE VARIABLE TEMP_VALOR NUMERIC(9,2);
DECLARE VARIABLE TEMP_CODDOCUMENTO INTEGER;
DECLARE VARIABLE TEMP_INFODOC VARCHAR(50);
DECLARE VARIABLE TEMP_ARQUIVO VARCHAR(50);
DECLARE VARIABLE TEMP_HISTORICO VARCHAR(1024);
DECLARE VARIABLE TEMP_DESCONTO NUMERIC(9,2);
DECLARE VARIABLE TEMP_MULTA_JUROS NUMERIC(9,2);
DECLARE VARIABLE TEMP_DATAVENCIMENTO TIMESTAMP;
DECLARE VARIABLE TEMP_STATUS VARCHAR(30);
DECLARE VARIABLE TEMP_CODCONTA INTEGER;
DECLARE VARIABLE TEMP_CODEMPRESA INTEGER;
DECLARE VARIABLE TEMP_TIPO_PAG CHAR(1);
DECLARE VARIABLE TEMP_TIPO_DOC CHAR(1);
DECLARE VARIABLE TEMP_CH_BANCO INTEGER;
DECLARE VARIABLE TEMP_CH_AGENCIA INTEGER;
DECLARE VARIABLE TEMP_CH_CONTA INTEGER;
DECLARE VARIABLE TEMP_CH_SERIE VARCHAR(10);
DECLARE VARIABLE TEMP_CH_NUMERO INTEGER;
DECLARE VARIABLE TEMP_CODCENTRO INTEGER;
DECLARE VARIABLE TEMP_CODCLIENTE INTEGER;
DECLARE VARIABLE TEMP_CODPLANO INTEGER;
DECLARE VARIABLE TEMP_CODIGO INTEGER;
DECLARE VARIABLE TEMP_DESCRICAO2 VARCHAR(40);
DECLARE VARIABLE TEMP_CODESTORNO INTEGER;
DECLARE VARIABLE TEMP_CODRELANC INTEGER;
DECLARE VARIABLE TEMP_CODANTIGO INTEGER;
DECLARE VARIABLE TEMP_NOMEUSUARIO VARCHAR(30);
DECLARE VARIABLE TEMP_NUMDOC INTEGER;
DECLARE VARIABLE TEMP_TIPODOC CHAR(3);
DECLARE VARIABLE TEMP_DATADOC DATE;
DECLARE VARIABLE TIPOMOV INTEGER;
BEGIN

  /* VERIFICO SE A CONTA FOI PAGA */
  SELECT
    PA.PAGO,
    PA.ES,
    MO.TIPO
  FROM
    PAGAMENTOS PA
    JOIN MOVIMENTOS MO ON
      (MO.CODIGO = PA.CODMOVIMENTO)
  WHERE
    PA.CODIGO = :CODIGO
  INTO
    :PAGO,
    :TEMP_ES,
    :TIPOMOV;

  /* NOME DO USUARIO */
  SELECT
    NOMEUSER
  FROM
    CLIENTES
  WHERE
    CODIGO = :CODUSUARIO
  INTO
    TEMP_NOMEUSUARIO;

  IF (TEMP_ES > 2) THEN
    EXIT;

  IF (PAGO = 1) THEN
   BEGIN

     /* POSSO ESTORNAR */
     SELECT
       CODMOVIMENTO,
       NUMERO,
       DESCRICAO,
       ES,
       VALOR,
       CODDOCUMENTO,
       INFODOC,
       ARQUIVO,
       HISTORICO,
       DESCONTO,
       MULTA_JUROS,
       DATAVENCIMENTO,
       STATUS,
       CODCONTA,
       CODEMPRESA,
       TIPO_PAG,
       TIPO_DOC,
       CH_BANCO,
       CH_AGENCIA,
       CH_CONTA,
       CH_SERIE,
       CH_NUMERO,
       CODCENTRO,
       CODCLIENTE,
       CODPLANO,
       CODANTIGO,
       NUMDOC,
       TIPODOC,
       DATADOC
     FROM
       PAGAMENTOS
     WHERE
       CODIGO = :CODIGO
     INTO
       :TEMP_CODMOVIMENTO,
       :TEMP_NUMERO,
       :TEMP_DESCRICAO,
       :TEMP_ES,
       :TEMP_VALOR,
       :TEMP_CODDOCUMENTO,
       :TEMP_INFODOC,
       :TEMP_ARQUIVO,
       :TEMP_HISTORICO,
       :TEMP_DESCONTO,
       :TEMP_MULTA_JUROS,
       :TEMP_DATAVENCIMENTO,
       :TEMP_STATUS,
       :TEMP_CODCONTA,
       :TEMP_CODEMPRESA,
       :TEMP_TIPO_PAG,
       :TEMP_TIPO_DOC,
       :TEMP_CH_BANCO,
       :TEMP_CH_AGENCIA,
       :TEMP_CH_CONTA,
       :TEMP_CH_SERIE,
       :TEMP_CH_NUMERO,
       :TEMP_CODCENTRO,
       :TEMP_CODCLIENTE,
       :TEMP_CODPLANO,
       :TEMP_CODANTIGO,
       :TEMP_NUMDOC, 
       :TEMP_TIPODOC, 
       :TEMP_DATADOC;

     /* LANCAMENTO CONTRA */
     IF (TEMP_ES = 1) THEN
       TEMP_ES = 2;
     ELSE
       TEMP_ES = 1;

     /* PEGO O CODIGO DO PROXIMO LANCAMENTO */
     EXECUTE PROCEDURE SEQ_OBTER('PAGAMENTOS')
       RETURNING_VALUES :TEMP_CODIGO;

     TEMP_CODESTORNO = TEMP_CODIGO;
     TEMP_DESCRICAO2 = 'EST ' || UDF_LEFT(TEMP_DESCRICAO, 36);

       PAGAMENTOS(
         CODIGO,
         CODMOVIMENTO,
         NUMERO,
         DESCRICAO,
         ES,
         VALOR,
         CODDOCUMENTO,
         INFODOC,
         ARQUIVO,
         HISTORICO,
         DESCONTO,
         MULTA_JUROS,
         DATAVENCIMENTO,
         STATUS,
         CODCONTA,
         CODEMPRESA,
         TIPO_PAG,
         TIPO_DOC,
         CH_BANCO,
         CH_AGENCIA,
         CH_CONTA,
         CH_SERIE,
         CH_NUMERO,
         CODCENTRO,
         CODCLIENTE,
         CODPLANO,
         PAGO,
         CODORIGEM,
         CODANTIGO,
         NOMEUSUARIO,
         NUMDOC,
         TIPODOC,
         DATADOC)
       VALUES (
         :TEMP_CODIGO,
         :TEMP_CODMOVIMENTO,
         :TEMP_NUMERO,
         :TEMP_DESCRICAO2,
         :TEMP_ES,
         :TEMP_VALOR,
         :TEMP_CODDOCUMENTO,
         :TEMP_INFODOC,
         :TEMP_ARQUIVO,
         :TEMP_HISTORICO,
         :TEMP_DESCONTO,
         :TEMP_MULTA_JUROS,
         :TEMP_DATAVENCIMENTO,
         :TEMP_STATUS,
         :TEMP_CODCONTA,
         :TEMP_CODEMPRESA,
         :TEMP_TIPO_PAG,
         :TEMP_TIPO_DOC,
         :TEMP_CH_BANCO,
         :TEMP_CH_AGENCIA,
         :TEMP_CH_CONTA,
         :TEMP_CH_SERIE,
         :TEMP_CH_NUMERO,
         :TEMP_CODCENTRO,
         :TEMP_CODCLIENTE,
         :TEMP_CODPLANO,
         1,
         :CODIGO,
         :TEMP_CODANTIGO,
         :TEMP_NOMEUSUARIO,
         :TEMP_NUMDOC,
         :TEMP_TIPODOC,
         :TEMP_DATADOC);

     /* REABRO O LANÃAMENTO - EXCETO SE FOR ESTORNO */
     IF (TIPOMOV <> 9) THEN
      BEGIN

        /* LANCAMENTO RESSUCITADO */
        IF (TEMP_ES = 1) THEN
          TEMP_ES = 2;
        ELSE
          TEMP_ES = 1;

        /* PEGO O CODIGO DO PROXIMO LANCAMENTO */
        EXECUTE PROCEDURE SEQ_OBTER('PAGAMENTOS')
          RETURNING_VALUES :TEMP_CODIGO;

        TEMP_CODRELANC = TEMP_CODIGO;

          PAGAMENTOS(
            CODIGO,
            CODMOVIMENTO,
            NUMERO,
            DESCRICAO,
            ES,
            VALOR,
            CODDOCUMENTO,
            INFODOC,
            ARQUIVO,
            HISTORICO,
            DESCONTO,
            MULTA_JUROS,
            DATAVENCIMENTO,
            STATUS,
            CODCONTA,
            CODEMPRESA,
            TIPO_PAG,
            TIPO_DOC,
            CH_BANCO,
            CH_AGENCIA,
            CH_CONTA,
            CH_SERIE,
            CH_NUMERO,
            CODCENTRO,
            CODCLIENTE,
            CODPLANO,
            PAGO,
            CODORIGEM,
            CODANTIGO,
            NUMDOC,
            TIPODOC,
            DATADOC)
          VALUES (
            :TEMP_CODIGO,
            :TEMP_CODMOVIMENTO,
            :TEMP_NUMERO,
            :TEMP_DESCRICAO,
            :TEMP_ES,
            :TEMP_VALOR,
            :TEMP_CODDOCUMENTO,
            :TEMP_INFODOC,
            :TEMP_ARQUIVO,
            :TEMP_HISTORICO,
            :TEMP_DESCONTO,
            :TEMP_MULTA_JUROS,
            :TEMP_DATAVENCIMENTO,
            :TEMP_STATUS,
            :TEMP_CODCONTA,
            :TEMP_CODEMPRESA,
            :TEMP_TIPO_PAG,
            :TEMP_TIPO_DOC,
            :TEMP_CH_BANCO,
            :TEMP_CH_AGENCIA,
            :TEMP_CH_CONTA,
            :TEMP_CH_SERIE,
            :TEMP_CH_NUMERO,
            :TEMP_CODCENTRO,
            :TEMP_CODCLIENTE,
            :TEMP_CODPLANO,
            0,
            :CODIGO,
            :TEMP_CODANTIGO,
            :TEMP_NUMDOC,
            :TEMP_TIPODOC,
            :TEMP_DATADOC);

      END

     /* GRAVO DADOS DO ESTORNO */
     UPDATE
       PAGAMENTOS
     SET
       ESTORNO_CODESTORNO = :TEMP_CODESTORNO,
       ESTORNO_CODRELANC  = :TEMP_CODRELANC,
       ESTORNO_CODUSUARIO = :CODUSUARIO,
       ESTORNO_DATA       = CURRENT_TIMESTAMP
     WHERE
       CODIGO = :CODIGO;

   END ELSE
   BEGIN

     /* ES */
     SELECT
       ES
     FROM
       PAGAMENTOS
     WHERE
       CODIGO = :CODIGO
     INTO
       :TEMP_ES;

     /* LANCAMENTO DE LIXEIRA */
     IF (TEMP_ES = 1) THEN
       TEMP_ES = 3;
     ELSE
       TEMP_ES = 4;

     /* GRAVO DADOS DO ESTORNO */
     UPDATE
       PAGAMENTOS
     SET
       ES = :TEMP_ES,
       ESTORNO_CODUSUARIO = :CODUSUARIO,
       ESTORNO_DATA       = CURRENT_TIMESTAMP
     WHERE
       CODIGO = :CODIGO;

   END

END^


ALTER PROCEDURE GERAPARCELAS (
    CODIGO INTEGER,
    MODO INTEGER)
AS
DECLARE VARIABLE TOTAL NUMERIC(9,2);
DECLARE VARIABLE PARCELA NUMERIC(9,2);
DECLARE VARIABLE CONDICAO VARCHAR(40);
DECLARE VARIABLE QUANTIDADE INTEGER;
DECLARE VARIABLE ES INTEGER;
DECLARE VARIABLE N INTEGER;
DECLARE VARIABLE CODPAG INTEGER;
DECLARE VARIABLE DATAMOV DATE;
DECLARE VARIABLE DIAS INTEGER;
DECLARE VARIABLE CODDOC INTEGER;
DECLARE VARIABLE CODPAGO INTEGER;
DECLARE VARIABLE DOCVISTA INTEGER;
DECLARE VARIABLE DOCPRAZO INTEGER;
DECLARE VARIABLE DESCRICAO CHAR(40);
DECLARE VARIABLE TIPO INTEGER;
DECLARE VARIABLE CODCONTA_COMPRADEB INTEGER;
DECLARE VARIABLE CODCONTA_VENDACRE INTEGER;
DECLARE VARIABLE CODCONTA INTEGER;
DECLARE VARIABLE CODCLIENTE INTEGER;
DECLARE VARIABLE CODEMPRESA INTEGER;
DECLARE VARIABLE CODCENTRO INTEGER;
DECLARE VARIABLE XES INTEGER;
DECLARE VARIABLE CODCONDPAG INTEGER;
DECLARE VARIABLE CODCENTRO_HP INTEGER;
DECLARE VARIABLE CODPLANO_HP INTEGER;
DECLARE VARIABLE VENDA CHAR(1);
DECLARE VARIABLE CODHISTORICOPAG INTEGER;
DECLARE VARIABLE NUMDOC INTEGER;
DECLARE VARIABLE DATADOC DATE;
DECLARE VARIABLE TIPODOC CHAR(3);
BEGIN

   /* MODO */
   IF (MODO IS NULL) THEN
     MODO = 0; /* GERAR TUDO */

   /* DADOS DO MOVIMENTO */
   SELECT
      NOTA_VALOR_TOTAL,
      CONDICAO,
      ES,
      CURRENT_DATE,
      TIPO,
      CODCLIENTE,
      CODEMPRESA,
      CODCENTRO,
      CODCONDPAG,
      NO_VENDA,
      CODHISTORICOPAG,
      NOTA_NUMERO,
      NOTA_DATAEMISSAO,
      TIPODOC
   FROM
      MOVIMENTOS
   WHERE
      CODIGO = :CODIGO
   INTO
      :TOTAL,
      :CONDICAO,
      :ES,
      :DATAMOV,
      :TIPO,
      :CODCLIENTE,
      :CODEMPRESA,
      :CODCENTRO,
      :CODCONDPAG,
      :VENDA,
      :CODHISTORICOPAG,
      :NUMDOC,
      :DATADOC,
      :TIPODOC;

   /* SE NAO FOR PARA GERAR FATURAMENTO, SAIO */
   IF (VENDA = 'N') THEN
     EXIT;

   /* SE O VALOR FOR ZERO NAO GERO NADA */
   IF (TOTAL <= 0) THEN EXIT;

   /* TEM FATURAMENTO? */
   SELECT
     HP.CODCENTRO,
     HP.CODPLANO
   FROM
     HISTORICOPAG HP
   WHERE
     HP.CODIGO = :CODHISTORICOPAG
   INTO
     :CODCENTRO_HP,
     :CODPLANO_HP;

   IF (CODCENTRO_HP IS NULL) THEN
     CODCENTRO_HP = CODCENTRO;

   /* DADOS DO PERFIL DA EMPRESA */
   SELECT
      CODDOC_AVISTA,
      CODDOC_PRAZO,
      CODCONTA_COMPRADEB,
      CODCONTA_VENDACRE
   FROM
      SISCONFIG
   WHERE
      CODIGO = :CODEMPRESA
   INTO
      :DOCVISTA,
      :DOCPRAZO,
      :CODCONTA_COMPRADEB,
      :CODCONTA_VENDACRE;

   /* CONDICAO DE PAGAMENTO CADASTRADA */
   IF (CODCONDPAG IS NOT NULL) THEN
    BEGIN
      SELECT
        CODDOC_AVISTA,
        CODDOC_PRAZO,
        CONDICAO
      FROM
        CONDPAG
      WHERE
        CODIGO = :CODCONDPAG
      INTO
        :DOCVISTA,
        :DOCPRAZO,
        :CONDICAO;
    END

   /* SE FOR ENTRADA */
   IF (ES = 1) THEN
    BEGIN
      CODCONTA = CODCONTA_COMPRADEB;
    END ELSE

    /* SE FOR UMA SAIDA */
    BEGIN
     CODCONTA = CODCONTA_VENDACRE;
    END

   /* QUANTIDADE DE PARCELAS */
   SELECT
      COUNT(*)
   FROM
      PARCELAS(
        :CONDICAO
      )
   INTO
      :QUANTIDADE;

   /* QUANTAS PARCELAS JÃ EXISTEM? */
   SELECT
     COUNT(*)
   FROM
     PAGAMENTOS
   WHERE
     (CODMOVIMENTO = :CODIGO) AND
     ((ES = :ES) OR (ES = 0))
   INTO
     :N;

   /* SE AS PARCELAS EXISTENTES FOREM DIFERENTES DAS A GERAR, GERO TUDO */
   IF (MODO = 1) THEN
     IF (QUANTIDADE <> N) THEN
       MODO = 0;

   /* SE TIVER PELO MENOS 1 PARCELA, GERO */
   IF (QUANTIDADE > 0) THEN
    BEGIN

      /* APAGO AS PARCELAS ANTIGAS SE FOR PARA GERAR TUDO */
      IF (MODO = 0) THEN
        DELETE FROM
          PAGAMENTOS
        WHERE
          CODMOVIMENTO = :CODIGO;

      /* VALOR DA PARCELA */
      PARCELA = CAST((TOTAL / QUANTIDADE) AS INTEGER);

      /* GERACAO DAS PARCELAS */
      N = 0;
      FOR
      SELECT
        DIAS
      FROM
        PARCELAS(:CONDICAO)
      INTO
        :DIAS
      DO
      BEGIN

        /* NUMERO DA PARCELA */
        N = N + 1;

        /* MODO SOMENTE VALORES A ALTERAR */
        IF (MODO > 0) THEN
         BEGIN

           UPDATE
             PAGAMENTOS
           SET
             VALOR = :PARCELA
           WHERE
             CODMOVIMENTO = :CODIGO AND
             NUMERO = :N;

         END ELSE
         BEGIN

           /* DESCRICAO DA PARCELA */
           IF (ES = 1) THEN
             DESCRICAO = 'ENTRADA ' || CODIGO || '/' || N || ' DE ' || QUANTIDADE;
           ELSE
             DESCRICAO = 'SAIDA ' || CODIGO || '/' || N || ' DE ' || QUANTIDADE;

           /* CODIGO SEQUENCIAL */
           SELECT
             SEQUENCIA
           FROM
             SEQ_OBTER('PAGAMENTOS')
           INTO
             :CODPAG;

           /* PARCELA A VISTA X PARCELA A PRAZO */
           IF (DIAS = 0) THEN
            BEGIN
              CODDOC = DOCVISTA;
              CODPAGO = 0;
            END ELSE
            BEGIN
              CODDOC = DOCPRAZO;
              CODPAGO = 0;
            END

           /* ESCONDO OS PAGAMENTOS DE OS E VENDA ABERTAS */
           XES = ES;
           IF ((XES = 2) AND (TIPO IN (3, 5))) THEN
             XES = 0;

           /* INSIRO A PARCELA */
             PAGAMENTOS (
               CODIGO,
               CODMOVIMENTO,
               NUMERO,
               DESCRICAO,
               ES,
               VALOR,
               DATAVENCIMENTO,
               CODDOCUMENTO,
               PAGO,
               CODCONTA,
               CODEMPRESA,
               CODCENTRO,
               CODPLANO,
               CODCLIENTE,
               NUMDOC,
               DATADOC,
               TIPODOC,
               CODHISTORICO)
             VALUES (
               :CODPAG,
               :CODIGO,
               :N,
               :DESCRICAO,
               :XES,
               :PARCELA,
               :DATAMOV + :DIAS,
               :CODDOC,
               :CODPAGO,
               :CODCONTA,
               :CODEMPRESA,
               :CODCENTRO_HP,
               :CODPLANO_HP,
               :CODCLIENTE,
               :NUMDOC,
               :DATADOC,
               :TIPODOC,
               :CODHISTORICOPAG);

         END

      END

      /* DIFERENÃA NA PRIMEIRA PARCELA */
      UPDATE
        PAGAMENTOS
      SET
        VALOR = VALOR + (:TOTAL - (:PARCELA * :QUANTIDADE))
      WHERE
        CODMOVIMENTO = :CODIGO AND NUMERO = 1;

    END ELSE EXCEPTION CONDICAO_ERRADA;
END^


