ALTER PROCEDURE IMPNOTA_LINHA (
    NUMIMPNOTA INTEGER,
    OFFSET INTEGER,
    INICIO INTEGER,
    FIM INTEGER)
AS
DECLARE VARIABLE LINHA INTEGER;
BEGIN

  IF (OFFSET < 0) THEN
   BEGIN

     FOR
     SELECT
       LINHA
     FROM
       ITIMPNOTA
     WHERE
       NUMIMPNOTA = :NUMIMPNOTA AND
       LINHA BETWEEN :INICIO AND :FIM
     ORDER BY
       LINHA
     INTO
       :LINHA
     DO
     BEGIN

       UPDATE
         ITIMPNOTA
       SET
         LINHA = LINHA + :OFFSET
       WHERE
         NUMIMPNOTA = :NUMIMPNOTA AND
         LINHA = :LINHA;

     END

   END ELSE
   BEGIN

     FOR
     SELECT
       LINHA
     FROM
       ITIMPNOTA
     WHERE
       NUMIMPNOTA = :NUMIMPNOTA AND
       LINHA BETWEEN :INICIO AND :FIM
     ORDER BY
       LINHA DESC
     INTO
       :LINHA
     DO
     BEGIN

       UPDATE
         ITIMPNOTA
       SET
         LINHA = LINHA + :OFFSET
       WHERE
         NUMIMPNOTA = :NUMIMPNOTA AND
         LINHA = :LINHA;

     END

   END

END^


