ALTER PROCEDURE REAJUSTE (
    CODMARCA INTEGER,
    PORCENTAGEM DECIMAL(9,4))
AS
DECLARE VARIABLE MARGEM1 DECIMAL(9,4);
DECLARE VARIABLE MARGEM2 DECIMAL(9,4);
DECLARE VARIABLE MARGEM3 DECIMAL(9,4);
DECLARE VARIABLE CUSTONOVO DECIMAL(9,3);
DECLARE VARIABLE CODPRODUTO INTEGER;
DECLARE VARIABLE CUSTO DECIMAL(9,3);
DECLARE VARIABLE VENDA1 DECIMAL(9,3);
DECLARE VARIABLE VENDA2 DECIMAL(9,3);
DECLARE VARIABLE VENDA3 DECIMAL(9,3);
BEGIN

  /* PRODUTOS DA MARCA */
  FOR
  SELECT
    PRODUTOS.CODIGO,
    PRODUTOS.PRECOCUSTO,
    PRODUTOS.PRECOVENDA,
    PRODUTOS.PRECOVENDA2,
    PRODUTOS.PRECOVENDA3
  FROM
    PRODUTOS
  WHERE
    PRODUTOS.CODMARCA = :CODMARCA
  INTO
    :CODPRODUTO,
    :CUSTO,
    :VENDA1,
    :VENDA2,
    :VENDA3
  DO
  BEGIN

    /* PRECO DE CUSTO EXISTE? */
    IF (CUSTO > 0) THEN
     BEGIN

       /* NOVO CUSTO */
       CUSTONOVO = CUSTO * ((PORCENTAGEM / 100) + 1);

       /* PRECO DE VENDA 1 */
       IF (VENDA1 > 0) THEN
        BEGIN
          MARGEM1 = ((VENDA1 / CUSTO) - 1) * 100;
          VENDA1 = CUSTONOVO * ((MARGEM1 / 100) + 1);
        END

       /* PRECO DE VENDA 2 */
       IF (VENDA2 > 0) THEN
        BEGIN
          MARGEM2 = ((VENDA2 / CUSTO) - 1) * 100;
          VENDA2 = CUSTONOVO * ((MARGEM2 / 100) + 1);
        END

       /* PRECO DE VENDA 3 */
       IF (VENDA3 > 0) THEN
        BEGIN
          MARGEM3 = ((VENDA3 / CUSTO) - 1) * 100;
          VENDA3 = CUSTONOVO * ((MARGEM3 / 100) + 1);
        END

       /* REAJUSTE */
       UPDATE
         PRODUTOS
       SET
         PRODUTOS.PRECOCUSTO  = :CUSTONOVO,
         PRODUTOS.PRECOVENDA  = :VENDA1,
         PRODUTOS.PRECOVENDA2 = :VENDA2,
         PRODUTOS.PRECOVENDA3 = :VENDA3
       WHERE
         PRODUTOS.CODIGO = :CODPRODUTO;

     END

  END

END^


ALTER PROCEDURE REINICIAR (
    ROTINA INTEGER)
AS
DECLARE VARIABLE CODCLIENTE1 INTEGER;
DECLARE VARIABLE CODCLIENTE2 INTEGER;
BEGIN

  /* DETERMINO A ROTINA */
  IF (ROTINA IS NULL) THEN
    ROTINA = 0;

  /* LIMPAR TUDO */
  IF (ROTINA = 0) THEN
   BEGIN

     /* SEQUENCIA */
     DELETE FROM
       ITSEQUENCIA;

     /* PAGAMENTOS */
     UPDATE
       PAGAMENTOS
     SET PAGO = 0;

     DELETE FROM
       COMISSOES;

     DELETE FROM
       CAIXAS;

     DELETE FROM
       PAGAMENTOS;

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = 1
     WHERE
       TABELA = 'PAGAMENTOS';

     /* ESTOQUE */
     UPDATE
       INDIVIDUAIS
     SET
       VENDIDO = 'N';

     DELETE FROM
       MOVESTOQUE;

     DELETE FROM
       INDIVIDUAIS;

     DELETE FROM
       TEMPITENS;

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = 1
     WHERE
       TABELA = 'INDIVIDUAIS';

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = 1
     WHERE
       TABELA = 'TEMPITENS';

     /* PRODUTOS */
     DELETE FROM
       VARIACAO_VALOR;

     DELETE FROM
       CONTRATOS;

     DELETE FROM
       COMPOSICAO;

     DELETE FROM
       PRODUTOS;

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = 10000
     WHERE
       TABELA = 'PRODUTOS';

     /* MOVIMENTOS */
     DELETE FROM
       OS_VENDER;

     DELETE FROM
       MOVIMENTOS;

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = 10000
     WHERE
       TABELA = 'MOVIMENTOS';

     /* EMPRESAS */
     DELETE FROM
       TRANSFERENCIAS;

     DELETE FROM
       SISCONFIG
     WHERE
       CODIGO > 1;

     /* CLIENTES */
     SELECT
       SI.CODCLIENTE,
       SI.CODCLIENTE_PADRAO
     FROM
       SISCONFIG SI
     WHERE
       SI.CODIGO = 1
     INTO
       :CODCLIENTE1,
       :CODCLIENTE2;

     DELETE FROM
       MENSAGENS;

     DELETE FROM
       CLIENTES
     WHERE
       CODIGO NOT IN (:CODCLIENTE1, :CODCLIENTE2);

     UPDATE
       SEQUENCIA
     SET
       SEQUENCIA = UDF_MAX(:CODCLIENTE1, :CODCLIENTE2) + 1
     WHERE
       TABELA = 'CLIENTES';

     UPDATE
       CLIENTES
     SET
       NOMEUSER = 'SYSDBA',
       SENHAWEB = 'MORAIS77',
       DESCONTO = 0,
       FINANCEIRO = 'S',
       ESTORNO = 'S',
       TROCAVENDEDOR = 'S',
       INTERNET = 'S',
       MUDAEMPRESA = 'S',
       COMISSAO = 0,
       TIPO = 'A',
       RECEBIMENTO = 'S',
       CUSTO = 'S',
       SEQUENCIAS = 'S',
       RECALCULO = 'S',
       COMPRAS = 'S',
       TRANSFERENCIA = 'S',
       RELATORIOS = 'S',
       VENDADIRETA = 'S',
       TECNICOLOGIN = 'N',
       FECHAMENTO = 'S'
     WHERE
       CODIGO = :CODCLIENTE1;


   END

END^


ALTER PROCEDURE REL_ATIVACAO_ENTRADA
RETURNS (
    CODEMPRESA INTEGER,
    RAZAOSOCIAL VARCHAR(60),
    DATA_ENTRADA DATE,
    NF_ENTRADA INTEGER,
    APARELHO VARCHAR(60),
    SERIE VARCHAR(20),
    SERIE2 VARCHAR(20),
    NUMERO_FONE VARCHAR(20),
    VALOR_TABELA NUMERIC(9,2),
    VALOR_PAGO NUMERIC(9,2),
    VALOR_CUSTO NUMERIC(9,2),
    REBATE CHAR(1),
    VALOR_REBATE NUMERIC(9,2),
    DATA_ATIVACAO DATE,
    OPERADORA VARCHAR(40),
    PLANO VARCHAR(40),
    CONTRATO VARCHAR(10),
    VOUCHER VARCHAR(20),
    TIPOATIVACAO CHAR(1))
AS
DECLARE VARIABLE CODINDIVIDUO INTEGER;
DECLARE VARIABLE CODMOVSAIDA INTEGER;
BEGIN

  /* SELECIONO AS ATIVAÃÃES */
  FOR
  SELECT
    ID.APARELO,
    ID.SERIE,
    ID.NUMERO_FONE,
    ID.REBATE,
    ID.CODIGO,
    ID.CODMOVSAIDA,
    ID.CODEMPRESA,
    ID.CONTRATO,
    ID.VOUCHER,
    ID.TIPOATIVACAO
  FROM
    INDIVIDUAIS ID
  WHERE
    ATIVACAO = 'S' AND
    VENDIDO = 'S' AND
    PS = 'P'
  INTO
    :APARELHO,
    :SERIE,
    :NUMERO_FONE,
    :REBATE,
    :CODINDIVIDUO,
    :CODMOVSAIDA,
    :CODEMPRESA,
    :CONTRATO,
    :VOUCHER,
    :TIPOATIVACAO
  DO
  BEGIN

    /* RAZAO SOCIAL DA EMPRESA */
    SELECT
      CL.RAZAOSOCIAL
    FROM
      CLIENTES CL
      JOIN SISCONFIG SI ON
        (SI.CODCLIENTE = CL.CODIGO)
    WHERE
      SI.CODIGO = :CODEMPRESA
    INTO
      :RAZAOSOCIAL;

    /* DADOS DA COMPRA E PRECO PAGO */
    SELECT
      ID.VALOR_VENDA,
      ID.VALOR_PAGO,
      CAST(MO.NOTA_DATAEMISSAO AS DATE),
      MO.NOTA_NUMERO,
      OP.NOME,
      PL.NOME,
      ID.SERIE2,
      ID.CUSTO_PRODUTO
    FROM
      INDIVIDUAIS ID
      JOIN MOVIMENTOS MO ON
        (MO.CODIGO = ID.CODMOVENTRADA)
      JOIN OPERADORAS OP ON
        (OP.CODIGO = ID.CODOPERADORA)
      JOIN PLANOS PL ON
        (PL.CODIGO = ID.CODPLANO AND
         PL.CODOPERADORA = ID.CODOPERADORA)
    WHERE
      ID.CODIGO = :CODINDIVIDUO
    INTO
      :VALOR_TABELA,
      :VALOR_PAGO,
      :DATA_ENTRADA,
      :NF_ENTRADA,
      :OPERADORA,
      :PLANO,
      :SERIE2,
      :VALOR_CUSTO;

    /* DATA DA ATIVACAO */
    SELECT
      CAST(MO.DATAFECHAMENTO AS DATE)
    FROM
      MOVIMENTOS MO
    WHERE
      MO.CODIGO = :CODMOVSAIDA
    INTO
      :DATA_ATIVACAO;

    VALOR_REBATE = NULL;
    IF (REBATE = 'S') THEN
      VALOR_REBATE = VALOR_TABELA - VALOR_PAGO;

    /* RETORNO OS VALORES */
    SUSPEND;
  END

END^


