    TR.RG,
    TR.CPF,
    TR.IE,
    TR.CGC,
    TR.LOGRADOURO,
    TR.BAIRRO,
    TR.CIDADE,
    TR.CEP,
    TR.MUNIBGE
  FROM
    CLIENTES TR
  WHERE
    TR.CODIGO = :NOTA_CODTRANSPORTADOR
  INTO
    :TRA_NOME,
    :TEMP_RAZAOSOCIAL,
    :TEMP_PESSOAFISICA,
    :TRA_NUMERO,
    :TRA_COMPLEMENTO,
    :TRA_ESTADO,
    :TRA_FONE,
    :TRA_FAX,
    :TRA_EMAIL,
    :TRA_RGIE,
    :TRA_CPFCGC,
    :TEMP_IE,
    :TEMP_CGC,
    :TRA_LOGRADOURO,
    :TRA_BAIRRO,
    :TRA_CIDADE,
    :TRA_CEP,
    :TRA_MUNIBGE;

  IF ( TEMP_PESSOAFISICA = 'J' ) THEN
   BEGIN
     TRA_RGIE   = TEMP_IE;
     TRA_CPFCGC = TEMP_CGC;
   END

  SELECT
    NOME
  FROM
    CLIENTES
  WHERE
    CODIGO = :CODVENDEDOR_ABRE
  INTO
    :VENDEDORABRE;

  SELECT
    NOME
  FROM
    CLIENTES
  WHERE
    CODIGO = :CODVENDEDOR
  INTO
    :VENDEDOR;

  SELECT
    DESCRICAO
  FROM
    MARCAS
  WHERE
    CODIGO = :CODMARCA
  INTO
    :MARCA;

  SELECT
    DESCRICAO
  FROM
    MODELOS
  WHERE
    CODIGO = :CODMODELO AND
    CODEQUIPAMENTO = :CODMARCA
  INTO
    :MODELO;

  SELECT
    DESCRICAO
  FROM
    DEFEITOS
  WHERE
    CODIGO = :CODDEFEITO
  INTO
    :DEFEITO;

  SELECT
    NATUREZA
  FROM
    NATUOPER
  WHERE
    CODIGO = :NOTA_CODNATUOPER
  INTO
    :NATUREZAOPERACAO;

  SELECT
    TIPO
  FROM
    OSTIPOS
  WHERE
    CODIGO = :OSTIPO
  INTO
    :TIPOOS;

  SELECT
    CL.NOME,
    CL.RAZAOSOCIAL,
    CL.CGC,
    CL.IE,
    CL.LOGRADOURO,
    CL.NUMERO,
    CL.COMPLEMENTO,
    CL.BAIRRO,
    CL.CIDADE,
    CL.ESTADO,
    CL.CEP,
    CL.FONE,
    CL.MUNIBGE,
    CL.CNAE,
    CL.IM,
    SI.MENSAGEM_OS,
    SI.MENSAGEM_VENDA,
    SI.ALIQUOTA_ICMSSIMPLES,
    SI.ICMSSIMPLES
  FROM
    SISCONFIG SI
    JOIN CLIENTES CL ON
      (SI.CODCLIENTE = CL.CODIGO)
  WHERE
    SI.CODIGO = :CODEMPRESA
  INTO
    :EMPRESA_NOME,
    :EMPRESA_RAZAOSOCIAL,
    :EMPRESA_CNPJ,
    :EMPRESA_IE,
    :EMPRESA_LOGRADOURO,
    :EMPRESA_NUMERO,
    :EMPRESA_COMPLEMENTO,
    :EMPRESA_BAIRRO,
    :EMPRESA_CIDADE,
    :EMPRESA_ESTADO,
    :EMPRESA_CEP,
    :EMPRESA_FONE,
    :EMPRESA_MUNIBGE,
    :EMPRESA_CNAE,
    :EMPRESA_IM,
    :MENSAGEM_OS,
    :MENSAGEM_VENDA,
    :ALIQUOTA_ICMSSIMPLES,
    :SIMPLES;

  USUARIO = USER;

  IF (ES = 1) THEN
   BEGIN

     XX_ENTRADA = 'XX';
     XX_SAIDA   = '  ';

   END ELSE
   BEGIN

     XX_ENTRADA = '  ';
     XX_SAIDA   = 'XX';

   END

  SELECT
    EXTENSO
  FROM
    MOEDAEXTENSO(
       CAST(:NOTA_VALOR_TOTAL AS DOUBLE PRECISION),
       :CODEMPRESA
    )
  INTO
    :EXTENSO;

 SELECT
   MIN(OS.CODVENDEDOR)
 FROM
   OS_VENDER OS
 WHERE
   OS.CODMOVIMENTO = :CODMOVIMENTO
 INTO
   :MAXTECNICO;

 SELECT
   UDF_LEFT(CL.NOME, 20)
 FROM
   CLIENTES CL
 WHERE
   CL.CODIGO = :MAXTECNICO
 INTO
   :TECNICO;

 AUTORIZADO_SIM = ' ';
 AUTORIZADO_NAO = ' ';

 IF (DATA_AUTORIZADO IS NOT NULL) THEN
  BEGIN
    IF (AUTORIZADO = 'S') THEN
      AUTORIZADO_SIM = 'X';
    ELSE
      AUTORIZADO_NAO = 'X';
  END

 SELECT
   NOME
 FROM
   CLIENTES
 WHERE
   CODIGO = :CODPARCEIRO
 INTO
   :PARCEIRO;

 IF (NO_IPI = 'S') THEN
  BEGIN

    SELECT
      SUM(VALOR_IPI)
    FROM
      REL_NOTAPRO(:CODMOVIMENTO)
    INTO
      :VALOR_IPI;

    IF (VALOR_IPI IS NULL) THEN
      VALOR_IPI = 0;

    NOTA_VALOR_TOTAL = NOTA_VALOR_TOTAL + VALOR_IPI;

  END

  /* TOTAL A SER TRIBUTADO */
  TOTAL_TRIBUTADO = 0;
  FOR
  SELECT
    SITTRIBU,
    VALOR_PAGO
  FROM
    REL_NOTAPRO(:CODMOVIMENTO)
  INTO
    :SITUACAOTRIBUTARIA,
    :VALORDOITEM
  DO
  BEGIN
    IF ((SITUACAOTRIBUTARIA = '060') OR (SITUACAOTRIBUTARIA = '160') OR (SITUACAOTRIBUTARIA = '260')) THEN
      TOTAL_TRIBUTADO = TOTAL_TRIBUTADO + VALORDOITEM;
  END
  TOTAL_CREDITOICMS = TOTAL_TRIBUTADO * (ALIQUOTA_ICMSSIMPLES / 100);

 SUSPEND;
END^


ALTER PROCEDURE REL_NOTADUP (
    CODMOVIMENTO INTEGER)
RETURNS (
    MOVIMENTO INTEGER,
    NUMERO SMALLINT,
    DESCRICAO VARCHAR(40),
    DATACADAST TIMESTAMP,
    VALOR NUMERIC(9,2),
    DATAVENCIMENTO TIMESTAMP,
    CODIGO INTEGER,
    DOCUMENTO VARCHAR(30),
    CLI_NOME VARCHAR(40),
    CLI_LOGRADOURO VARCHAR(40),
    CLI_NUMERO INTEGER,
    CLI_COMPLEMENTO VARCHAR(40),
    CLI_BAIRRO VARCHAR(60),
    CLI_CEP VARCHAR(10),
    CLI_CIDADE VARCHAR(60),
    CLI_ESTADO VARCHAR(2),
    CLI_FONE VARCHAR(20),
    CLI_FAX VARCHAR(20),
    CLI_EMAIL VARCHAR(50),
    CLI_RGIE VARCHAR(20),
    CLI_CPFCGC VARCHAR(20),
    CLI_MUNIBGE VARCHAR(10),
    CODCLIENTE INTEGER,
    DATAPAGO TIMESTAMP,
    NOMEUSUARIO VARCHAR(30),
    DESCONTO NUMERIC(9,2),
    MULTA_JUROS NUMERIC(9,2),
    TOTAL_PAGO NUMERIC(9,2),
    INFODOC VARCHAR(50),
    EXTENSO VARCHAR(254),
    CODEMPRESA INTEGER,
    EMPRESA_NOME VARCHAR(40),
    EMPRESA_RAZAOSOCIAL VARCHAR(50),
    EMPRESA_CNPJ VARCHAR(20),
    EMPRESA_IE VARCHAR(20),
    EMPRESA_LOGRADOURO VARCHAR(60),
    EMPRESA_NUMERO INTEGER,
    EMPRESA_COMPLEMENTO VARCHAR(40),
    EMPRESA_BAIRRO VARCHAR(60),
    EMPRESA_CIDADE VARCHAR(60),
    EMPRESA_ESTADO CHAR(2),
    EMPRESA_CEP VARCHAR(9),
    EMPRESA_FONE VARCHAR(20),
    EMPRESA_MUNIBGE VARCHAR(10),
    NOTA_NUMERO INTEGER,
    NOTA_DATAEMISSAO TIMESTAMP)
AS
DECLARE VARIABLE CODDOCUMENTO INTEGER;
DECLARE VARIABLE TEMP_PESSOAFISICA CHAR(1);
DECLARE VARIABLE TEMP_RAZAOSOCIAL VARCHAR(40);
DECLARE VARIABLE TEMP_IE VARCHAR(20);
DECLARE VARIABLE TEMP_CGC VARCHAR(20);
BEGIN
   FOR
   SELECT
     CODIGO,
     NUMERO,
     DESCRICAO,
     DATACADAST,
     VALOR,
     DATAVENCIMENTO,
     CODDOCUMENTO,
     DATAPAGO,
     NOMEUSUARIO,
     DESCONTO,
     MULTA_JUROS,
     TOTAL_PAGO,
     INFODOC,
     CODEMPRESA
   FROM
     PAGAMENTOS
   WHERE
     CODMOVIMENTO = :CODMOVIMENTO AND
     ES = 2
   INTO
     :CODIGO,
     :NUMERO,
     :DESCRICAO,
     :DATACADAST,
     :VALOR,
     :DATAVENCIMENTO,
     :CODDOCUMENTO,
     :DATAPAGO,
     :NOMEUSUARIO,
     :DESCONTO,
     :MULTA_JUROS,
     :TOTAL_PAGO,
     :INFODOC,
     :CODEMPRESA
   DO
   BEGIN
     MOVIMENTO = CODMOVIMENTO;
     /* PEGO O DOCUMENTO */
     SELECT
       DOCUMENTO
     FROM
       DOCUMENTOS
     WHERE
       CODIGO = :CODDOCUMENTO
     INTO
       :DOCUMENTO;

     /* CODIGO DO CLIENTE */
     SELECT
       CODCLIENTE,
       NOTA_NUMERO,
       NOTA_DATAEMISSAO
     FROM
       MOVIMENTOS
     WHERE
       CODIGO = :CODMOVIMENTO
     INTO
       :CODCLIENTE,
       :NOTA_NUMERO,
       :NOTA_DATAEMISSAO;

     /* DADOS DO CLIENTE */
     SELECT
       CL.NOME,
       UDF_LEFT(CL.RAZAOSOCIAL, 40),
       CL.PESSOAFISICA,
       CL.NUMERO,
       CL.COMPLEMENTO,
       CL.ESTADO,
       CL.FONE,
       CL.FAX,
       CL.EMAIL,
       CL.RG,
       CL.CPF,
       CL.IE,
       CL.CGC,
       UDF_LEFT(CL.LOGRADOURO, 40),
       CL.BAIRRO,
       CL.CIDADE,
       CL.CEP,
       CL.MUNIBGE
     FROM
       CLIENTES CL
     WHERE
       CL.CODIGO = :CODCLIENTE
     INTO
       :CLI_NOME,
       :TEMP_RAZAOSOCIAL,
       :TEMP_PESSOAFISICA,
       :CLI_NUMERO,
       :CLI_COMPLEMENTO,
       :CLI_ESTADO,
       :CLI_FONE,
       :CLI_FAX,
       :CLI_EMAIL,
       :CLI_RGIE,
       :CLI_CPFCGC,
       :TEMP_IE,
       :TEMP_CGC,
       :CLI_LOGRADOURO,
       :CLI_BAIRRO,
       :CLI_CIDADE,
       :CLI_CEP,
       :CLI_MUNIBGE;
     IF ( TEMP_PESSOAFISICA = 'J' ) THEN
      BEGIN
       CLI_NOME   = TEMP_RAZAOSOCIAL;
       CLI_RGIE   = TEMP_IE;
       CLI_CPFCGC = TEMP_CGC;
      END
     /* DADOS DA EMPRESA */
     SELECT
       CL.NOME,
       CL.RAZAOSOCIAL,
       CL.CGC,
       CL.IE,
       CL.LOGRADOURO,
       CL.NUMERO,
       CL.COMPLEMENTO,
       CL.BAIRRO,
       CL.CIDADE,
       CL.ESTADO,
       CL.CEP,
       CL.FONE,
       CL.MUNIBGE
     FROM
       SISCONFIG SI
       JOIN CLIENTES CL ON
         (SI.CODCLIENTE = CL.CODIGO)
     WHERE
       SI.CODIGO = :CODEMPRESA
     INTO
       :EMPRESA_NOME,
       :EMPRESA_RAZAOSOCIAL,
       :EMPRESA_CNPJ,
       :EMPRESA_IE,
       :EMPRESA_LOGRADOURO,
       :EMPRESA_NUMERO,
       :EMPRESA_COMPLEMENTO,
       :EMPRESA_BAIRRO,
       :EMPRESA_CIDADE,
       :EMPRESA_ESTADO,
       :EMPRESA_CEP,
       :EMPRESA_FONE,
       :EMPRESA_MUNIBGE;
     SELECT
       EXTENSO
     FROM
       MOEDAEXTENSO(
          CAST(:TOTAL_PAGO AS DOUBLE PRECISION),
          :CODEMPRESA
       )
     INTO
       :EXTENSO;

     /* A VISTA */
     IF (UDF_LEFT(DOCUMENTO, 7) = 'A VISTA') THEN
       DATAVENCIMENTO = NULL;

     SUSPEND;
   END
END^


ALTER PROCEDURE REL_NOTAITENS (
    CODMOVIMENTO INTEGER)
RETURNS (
    CODIGO INTEGER,
    BARRA CHAR(13),
    DESCRICAO1 VARCHAR(60),
    DESCRICAO2 VARCHAR(80),
    SERIE VARCHAR(20),
    SERIE2 VARCHAR(20),
    VALOR_VENDA NUMERIC(14,3),
    ICMS_VENDA NUMERIC(14,4),
    DESCONTO NUMERIC(14,3),
    QUANTIDADE NUMERIC(14,3),
    VALOR_PAGO NUMERIC(14,3),
    VALOR_ICMS NUMERIC(14,3),
    SITTRIBU CHAR(3),
    UNIDADE CHAR(2),
    VALOR_ITEM NUMERIC(14,3),
    IPI NUMERIC(14,4),
    LINHA VARCHAR(20),
    OPERADORA VARCHAR(40),
    PLANO VARCHAR(40),
    ATIVACAO CHAR(1),
    CONTRATO VARCHAR(10),
    VOUCHER VARCHAR(10),
    TIPOATIVACAO CHAR(1),
    VALOR_CUSTO NUMERIC(14,3),
    CLASSFISCAL VARCHAR(20),
    PESO NUMERIC(9,3),
    DESCONTO_ADM NUMERIC(9,2),
    NCM INTEGER,
    PS CHAR(1),
    LOCALIZACAO VARCHAR(40),
    PARTNUMBER VARCHAR(30))
AS
DECLARE VARIABLE ESMOV INTEGER;
DECLARE VARIABLE TIPOMOV INTEGER;
BEGIN

  SELECT
    ES,
    TIPO
  FROM
    MOVIMENTOS
  WHERE
    CODIGO = :CODMOVIMENTO
  INTO
    :ESMOV,
    :TIPOMOV;

  IF ((TIPOMOV = 9) OR ((ESMOV = 0) AND (TIPOMOV = 1))) THEN
   BEGIN

     /* ITENS ESTORNADOS OU DE ORÃâ¡AMENTO */
     FOR
     SELECT
       TI.CODPRODUTO,
       PO.BARRA,
       PO.DESCRICAO,
       PO.DESCRICAO,
       TI.SERIE,
       TI.SERIE2,
       TI.VALOR_UNITARIO,
       TI.ICMSVENDA,
       TI.DESCONTO,
       TI.QUANTIDADE,
       TI.VALOR_TOTAL,
       TI.VALOR_ICMSCOMPRA,
       TI.SITTRIBU,
       PO.UNIDADE,
       PO.ATIVACAO,
       (TI.VALOR_UNITARIO - TI.DESCONTO),
       TI.IPI,
       PO.PRECOCUSTO,
       PO.PESO,
       PO.CODNCM,
       PO.PS,
       PO.LOCALIZACAO,
       PO.PARTNUMBER
     FROM
       TEMPITENS TI
       JOIN PRODUTOS PO ON
        (PO.CODIGO = TI.CODPRODUTO)
     WHERE
       CODMOVIMENTO = :CODMOVIMENTO
     INTO
       :CODIGO,
       :BARRA,
       :DESCRICAO1,
       :DESCRICAO2,
       :SERIE,
       :SERIE2,
       :VALOR_VENDA,
       :ICMS_VENDA,
       :DESCONTO,
       :QUANTIDADE,
       :VALOR_PAGO,
       :VALOR_ICMS,
       :SITTRIBU,
       :UNIDADE,
       :ATIVACAO,
       :VALOR_ITEM,
       :IPI,
       :VALOR_CUSTO,
       :PESO,
       :NCM,
       :PS,
       :LOCALIZACAO,
       :PARTNUMBER
     DO
     BEGIN

       /* TRATAMENTO DA SERIE */
       IF ((UDF_TRIM(SERIE) <> 'N/F') AND (UDF_TRIM(SERIE) > '')) THEN
        BEGIN
          DESCRICAO2 = UDF_TRIM(DESCRICAO1) || ' ' || UDF_TRIM(SERIE);
        END ELSE
        BEGIN
          IF (UDF_TRIM(SERIE2) > '') THEN
           BEGIN
             DESCRICAO2 = UDF_TRIM(DESCRICAO1) || ' ' || UDF_TRIM(SERIE2);
           END ELSE
             DESCRICAO2 = UDF_TRIM(DESCRICAO1);
        END

       PESO = PESO * QUANTIDADE;

       LINHA = NULL;
       OPERADORA = NULL;
       PLANO = NULL;
       CONTRATO = NULL;
       VOUCHER = NULL;
       TIPOATIVACAO = NULL;
       CLASSFISCAL = NULL;

       SUSPEND;

     END

   END ELSE
   BEGIN

     /* PRODUTOS */
     FOR
     SELECT
       CODIGO,
       BARRA,
       DESCRICAO1,
       DESCRICAO2,
       SERIE,
       SERIE2,
       VALOR_VENDA,
       ICMS_VENDA,
       DESCONTO,
       QUANTIDADE,
       VALOR_PAGO,
       VALOR_ICMS,
       SITTRIBU,
       UNIDADE,
       VALOR_ITEM,
       IPI,
       LINHA,
       OPERADORA,
       PLANO,
       'N',
       CONTRATO,
       VOUCHER,
       TIPOATIVACAO,
       DESCONTO_ADM,
       CLASSFISCAL,
       PESO,
       NCM,
       'P',
       LOCALIZACAO,
       PARTNUMBER
     FROM
       REL_NOTAPRO(:CODMOVIMENTO)
     INTO
       :CODIGO,
       :BARRA,
       :DESCRICAO1,
       :DESCRICAO2,
       :SERIE,
       :SERIE2,
       :VALOR_VENDA,
       :ICMS_VENDA,
       :DESCONTO,
       :QUANTIDADE,
       :VALOR_PAGO,
       :VALOR_ICMS,
       :SITTRIBU,
       :UNIDADE,
       :VALOR_ITEM,
       :IPI,
       :LINHA,
       :OPERADORA,
       :PLANO,
       :ATIVACAO,
       :CONTRATO,
       :VOUCHER,
       :TIPOATIVACAO,
       :DESCONTO_ADM,
       :CLASSFISCAL,
       :PESO,
       :NCM,
       :PS,
       :LOCALIZACAO,
       :PARTNUMBER
     DO
     BEGIN

       VALOR_CUSTO = 0;
       SUSPEND;

     END

     /* SERVIÃâ¡OS */
     FOR
     SELECT
       CODIGO,
       BARRA,
       DESCRICAO1,
       DESCRICAO2,
       SERIE,
       SERIE2,
       VALOR_VENDA,
       ICMS_VENDA,
       DESCONTO,
       QUANTIDADE,
       VALOR_PAGO,
       VALOR_ICMS,
       SITTRIBU,
       'SE',
       VALOR_ITEM,
       0 AS IPI,
       ATIVACAO,
       'S'
     FROM
       REL_NOTASER(:CODMOVIMENTO)
     INTO
       :CODIGO,
       :BARRA,
       :DESCRICAO1,
       :DESCRICAO2,
       :SERIE,
       :SERIE2,
       :VALOR_VENDA,
       :ICMS_VENDA,
       :DESCONTO,
       :QUANTIDADE,
       :VALOR_PAGO,
       :VALOR_ICMS,
       :SITTRIBU,
       :UNIDADE,
       :VALOR_ITEM,
       :IPI,
       :ATIVACAO,
       :PS
     DO
     BEGIN

       PESO = 0;
       LINHA = NULL;
       OPERADORA = NULL;
       PLANO = NULL;
       CONTRATO = NULL;
       VOUCHER = NULL;
       TIPOATIVACAO = NULL;
       DESCONTO_ADM = 0;
       VALOR_CUSTO = 0;
       CLASSFISCAL = NULL;
       NCM = NULL;
       LOCALIZACAO = NULL;
       PARTNUMBER = NULL;
       SUSPEND;

     END

   END
END^


ALTER PROCEDURE REL_NOTAPRO (
    CODMOVIMENTO INTEGER)
RETURNS (
    CODIGO INTEGER,
    BARRA CHAR(13),
    DESCRICAO1 VARCHAR(60),
    DESCRICAO2 VARCHAR(80),
    SERIE VARCHAR(20),
    SERIE2 VARCHAR(20),
    VALOR_VENDA NUMERIC(14,3),
    ICMS_VENDA NUMERIC(14,4),
    DESCONTO NUMERIC(14,3),
    QUANTIDADE NUMERIC(14,3),
    VALOR_PAGO NUMERIC(14,3),
    VALOR_ICMS NUMERIC(14,3),
    SITTRIBU CHAR(3),
    UNIDADE CHAR(2),
    VALOR_ITEM NUMERIC(14,3),
    IPI NUMERIC(14,4),
    LINHA VARCHAR(20),
    OPERADORA VARCHAR(40),
    PLANO VARCHAR(40),
    CONTRATO VARCHAR(10),
    VOUCHER VARCHAR(10),
    TIPOATIVACAO CHAR(1),
    CLASSFISCAL VARCHAR(20),
    PESO NUMERIC(9,3),
    VALOR_IPI NUMERIC(14,3),
    DESCONTO_ADM NUMERIC(9,2),
    NCM INTEGER,
    LOCALIZACAO VARCHAR(40),
    PARTNUMBER VARCHAR(30))
AS
DECLARE VARIABLE ES INTEGER;
DECLARE VARIABLE XIPI CHAR(1);
DECLARE VARIABLE FATURA_CAIXAS CHAR(1);
DECLARE VARIABLE CAIXA_ITENS INTEGER;
DECLARE VARIABLE N INTEGER;
BEGIN
  /* VERIFICO SE EH COMPRA OU VENDA */
  SELECT
    ES
  FROM
    MOVIMENTOS
  WHERE
    CODIGO = :CODMOVIMENTO
  INTO
    :ES;

  IF (ES = 1) THEN
   BEGIN

     /* COMPRA */
     FOR
     SELECT
       TI.CODPRODUTO,
       PO.BARRA,
       PO.DESCRICAO,
       PO.UNIDADE,
       PO.CLASSFISCAL,
       PO.PESO,
       PO.CODNCM,
       'N/F',
       TI.VALOR_UNITARIO,
       TI.ICMSCOMPRA,
       TI.DESCONTO,
       TI.SITTRIBU,
       TI.QUANTIDADE,
       TI.VALOR_TOTAL,
       TI.VALOR_ICMSCOMPRA,
       PO.LOCALIZACAO,
       PO.PARTNUMBER
     FROM
       TEMPITENS TI
       LEFT JOIN PRODUTOS PO ON
         ( PO.CODIGO = TI.CODPRODUTO )
     WHERE
       TI.CODMOVIMENTO = :CODMOVIMENTO
     INTO
       :CODIGO,
       :BARRA,
       :DESCRICAO1,
       :UNIDADE,
       :CLASSFISCAL,
       :PESO,
       :NCM,
       :SERIE,
       :VALOR_VENDA,
       :ICMS_VENDA,
       :DESCONTO,
       :SITTRIBU,
       :QUANTIDADE,
       :VALOR_PAGO,
       :VALOR_ICMS,
       :LOCALIZACAO,
       :PARTNUMBER
     DO
     BEGIN

       IF (SERIE <> 'N/F') THEN
        BEGIN
          N = UDF_LEN(UDF_TRIM(DESCRICAO1));
          IF (N > 40) THEN
            DESCRICAO2 = UDF_COPY(DESCRICAO1, 1, 40) || ' ' || UDF_TRIM(SERIE);
          ELSE
            DESCRICAO2 = UDF_TRIM(DESCRICAO1) || ' ' || UDF_TRIM(SERIE);
        END ELSE
          DESCRICAO2 = DESCRICAO1;

       VALOR_ITEM = VALOR_VENDA - DESCONTO;
       PESO = PESO * QUANTIDADE;
       LINHA = NULL;
       OPERADORA = NULL;
       PLANO = NULL;
       CONTRATO = NULL;
       VOUCHER = NULL;
       TIPOATIVACAO = NULL;
       SUSPEND;

    END

   END ELSE
   BEGIN

     /* VERIFICO SE CORTO IPI */
     SELECT
       NA.IPI
     FROM
       NATUOPER NA
       JOIN MOVIMENTOS MO ON
         (MO.NOTA_CODNATUOPER = NA.CODIGO)
     WHERE
       MO.CODIGO = :CODMOVIMENTO
     INTO
       :XIPI;

     /* VERIFICO SE VAI FATURAR POR CAIXAS */
     SELECT
       HG.FATURA_CAIXAS
     FROM
       HISTORICOPAG HG
       JOIN MOVIMENTOS MO ON
         (MO.CODHISTORICOPAG = HG.CODIGO)
     WHERE
       MO.CODIGO = :CODMOVIMENTO
     INTO
       :FATURA_CAIXAS;

     /* VENDA */
     FOR
     SELECT
       ID.CODPRODUTO,
       ID.BARRA,
       PO.DESCRICAO,
       PO.UNIDADE,
       PO.CLASSFISCAL,
       PO.PESO,
       PO.CAIXA_ITENS,
       PO.CODNCM,
       ID.SERIE,
       ID.SERIE2,
       ID.VALOR_VENDA,
       ID.ICMSVENDA,
       ID.DESCONTO,
       TI.SITTRIBU,
       TI.IPI,
       ID.NUMERO_FONE,
       ID.CONTRATO,
       ID.VOUCHER,
       ID.TIPOATIVACAO,
       ID.DESCONTO_ADM, 
       OP.NOME,
       PL.NOME,
       PO.LOCALIZACAO,
       PO.PARTNUMBER,
       SUM(ID.QUANTIDADE),
       SUM(ID.VALOR_PAGO),
       SUM(ID.VALOR_ICMS)
     FROM
       INDIVIDUAIS ID
       LEFT JOIN PRODUTOS PO ON
         ( PO.CODIGO = ID.CODPRODUTO )
       LEFT JOIN TEMPITENS TI ON
         ( TI.CODMOVIMENTO = ID.CODMOVENTRADA AND
           TI.CODPRODUTO   = ID.CODPRODUTO    AND
           TI.CODIGO       = ID.CODITEM )
       LEFT JOIN OPERADORAS OP ON
         ( OP.CODIGO = ID.CODOPERADORA )
       LEFT JOIN PLANOS PL ON
         ( PL.CODIGO = ID.CODPLANO AND
           PL.CODOPERADORA = ID.CODOPERADORA )
     WHERE
       ID.CODMOVSAIDA = :CODMOVIMENTO AND
       ID.VENDIDO = 'S' AND
       ID.PS = 'P'
     GROUP BY
       ID.CODPRODUTO,
       ID.BARRA,
       PO.DESCRICAO,
       PO.UNIDADE,
       PO.CLASSFISCAL,
       PO.PESO,
       PO.CAIXA_ITENS,
       PO.CODNCM,
       ID.SERIE,
       ID.SERIE2,
       ID.VALOR_VENDA,
       ID.ICMSVENDA,
       ID.DESCONTO,
       TI.SITTRIBU,
       TI.IPI,
       ID.NUMERO_FONE,
       ID.CONTRATO,
       ID.VOUCHER,
       ID.TIPOATIVACAO,
       ID.DESCONTO_ADM,
       OP.NOME,
       PL.NOME,
       PO.LOCALIZACAO,
       PO.PARTNUMBER
     INTO
       :CODIGO,
       :BARRA,
       :DESCRICAO1,
       :UNIDADE,
       :CLASSFISCAL,
       :PESO,
       :CAIXA_ITENS,
       :NCM,
       :SERIE,
       :SERIE2,
       :VALOR_VENDA,
       :ICMS_VENDA,
       :DESCONTO,
       :SITTRIBU,
       :IPI,
       :LINHA,
       :CONTRATO,
       :VOUCHER,
       :TIPOATIVACAO,
       :DESCONTO_ADM,
       :OPERADORA,
       :PLANO,
       :LOCALIZACAO,
       :PARTNUMBER,
       :QUANTIDADE,
       :VALOR_PAGO,
       :VALOR_ICMS
     DO
     BEGIN

       /* VERIFICO SE O SERIE2 CONTEM DADOS E SERIE NAO, MANDO SERIE2 */
       IF ((UDF_TRIM(SERIE) = 'N/F') OR (UDF_TRIM(SERIE) = '')) THEN
         IF (UDF_TRIM(SERIE2) > '') THEN
           SERIE = SERIE2;

       IF (SERIE <> 'N/F') THEN
        BEGIN
          N = UDF_LEN(UDF_TRIM(DESCRICAO1));
          IF (N > 40) THEN
            DESCRICAO2 = UDF_COPY(DESCRICAO1, 1, 40) || ' ' || UDF_TRIM(SERIE);
          ELSE
            DESCRICAO2 = UDF_TRIM(DESCRICAO1) || ' ' || UDF_TRIM(SERIE);
        END ELSE
          DESCRICAO2 = DESCRICAO1;

       IF (CAIXA_ITENS IS NULL) THEN
         CAIXA_ITENS = 0;

       IF ((FATURA_CAIXAS = 'S') AND
          (QUANTIDADE >= CAIXA_ITENS)) THEN
        BEGIN
          UNIDADE = 'CX';
          QUANTIDADE = QUANTIDADE / CAIXA_ITENS;
          VALOR_VENDA = VALOR_VENDA * CAIXA_ITENS;
          DESCONTO = DESCONTO * CAIXA_ITENS;
        END

       VALOR_ITEM = VALOR_VENDA - DESCONTO;
       PESO = PESO * QUANTIDADE;

       IF (XIPI = 'N') THEN
        BEGIN
          IPI = NULL;
          VALOR_IPI = NULL;
        END ELSE
        BEGIN
          IF (IPI > 0) THEN
            VALOR_IPI = VALOR_PAGO * (IPI / 100);
          ELSE
            VALOR_IPI = 0;
        END

       SUSPEND;

     END
   END
END^


ALTER PROCEDURE REL_NOTASER (
    CODMOVIMENTO INTEGER)
RETURNS (
    CODIGO INTEGER,
    BARRA CHAR(13),
    DESCRICAO1 VARCHAR(40),
    DESCRICAO2 VARCHAR(60),
    SERIE VARCHAR(20),
    SERIE2 VARCHAR(20),
    VALOR_VENDA NUMERIC(9,2),
    ICMS_VENDA NUMERIC(9,2),
    DESCONTO NUMERIC(9,2),
    QUANTIDADE NUMERIC(9,2),
    VALOR_PAGO NUMERIC(9,2),
    VALOR_ICMS NUMERIC(9,2),
    SITTRIBU CHAR(3),
    VALOR_ITEM NUMERIC(9,2),
    LINHA VARCHAR(20),
    OPERADORA VARCHAR(40),
    PLANO VARCHAR(40),
    ATIVACAO CHAR(1))
AS
BEGIN
  FOR
  SELECT
    ID.CODPRODUTO,
    ID.BARRA,
    UDF_LEFT(PO.DESCRICAO, 40),
    ID.SERIE,
    ID.SERIE2,
    ID.VALOR_VENDA,
    ID.ICMSVENDA,
    ID.DESCONTO,
    ID.QUANTIDADE,
    ID.VALOR_PAGO,
    ID.VALOR_ICMS,
    TI.SITTRIBU,
    PO.ATIVACAO
  FROM
    INDIVIDUAIS ID
    LEFT JOIN PRODUTOS PO ON
      ( PO.CODIGO = ID.CODPRODUTO )
    LEFT JOIN TEMPITENS TI ON
      ( TI.CODMOVIMENTO = ID.CODMOVENTRADA AND
    TI.CODPRODUTO   = ID.CODPRODUTO    AND
    TI.CODIGO       = ID.CODITEM )
  WHERE
    ID.CODMOVSAIDA = :CODMOVIMENTO AND
    ID.VENDIDO = 'S' AND
    ID.PS = 'S'
  INTO
    :CODIGO,
    :BARRA,
    :DESCRICAO1,
    :SERIE,
    :SERIE2,
    :VALOR_VENDA,
    :ICMS_VENDA,
    :DESCONTO,
    :QUANTIDADE,
    :VALOR_PAGO,
    :VALOR_ICMS,
    :SITTRIBU,
    :ATIVACAO
  DO
  BEGIN
    DESCRICAO2 = DESCRICAO1 || ' ' || SERIE;
    VALOR_ITEM = VALOR_VENDA - DESCONTO;
    LINHA = NULL;
    OPERADORA = NULL;
    PLANO = NULL;
    SUSPEND;
  END
END^


