ALTER PROCEDURE VENDA_FECHA (
    CODMOVIMENTO INTEGER,
    USUARIOFECHAMENTO VARCHAR(30),
    OBSERVACOES VARCHAR(254),
    CONDICOES1 VARCHAR(512),
    CONDICOES2 VARCHAR(512),
    OPCIONAIS VARCHAR(512))
RETURNS (
    RE_MOVIMENTO INTEGER)
AS
DECLARE VARIABLE TIPO INTEGER;
DECLARE VARIABLE ES INTEGER;
DECLARE VARIABLE FECHADO CHAR(1);
BEGIN

  RE_MOVIMENTO = 0;
  FECHADO = 'N';

  IF (USUARIOFECHAMENTO IS NULL) THEN
    USUARIOFECHAMENTO = '';

  /* LEIO O TIPO ATUAL */
  SELECT
    ES,
    TIPO
  FROM
    MOVIMENTOS
  WHERE
    CODIGO = :CODMOVIMENTO
  INTO
    :ES,
    :TIPO;

  IF (TIPO IN (1, 2, 5)) THEN
   BEGIN

     IF ((ES = 1) AND (TIPO = 1) AND (USUARIOFECHAMENTO > '')) THEN
       FECHADO = 'S';

     IF ((ES = 2) AND (USUARIOFECHAMENTO > '')) THEN
      BEGIN

        IF (TIPO = 2) THEN
          TIPO = 3;
        ELSE
          TIPO = 6;

        FECHADO = 'S';

      END

     IF (RE_MOVIMENTO = 0) THEN
      BEGIN

        UPDATE
          MOVIMENTOS
        SET
          TIPO = :TIPO,
          USUARIOFECHAMENTO = :USUARIOFECHAMENTO,
          DATAFECHAMENTO = CURRENT_TIMESTAMP,
          OBSERVACOES = :OBSERVACOES,
          CONDICOES1 = :CONDICOES1,
          CONDICOES2 = :CONDICOES2,
          OPCIONAIS = :OPCIONAIS,
          FECHADO = :FECHADO
        WHERE
          CODIGO = :CODMOVIMENTO;

        /*WHEN ANY DO RE_MOVIMENTO = 1;*/

      END

   END

END^


ALTER PROCEDURE VERIFICA_PESSOA (
    CODCLIENTE INTEGER,
    CODEMPRESA INTEGER)
RETURNS (
    BLOQUEIO CHAR(1),
    MENSAGEM VARCHAR(80))
AS
DECLARE VARIABLE TIPO_BLOQUEIO CHAR(1);
DECLARE VARIABLE TIPO_IMPEDIMENTO CHAR(1);
DECLARE VARIABLE LIMITE NUMERIC(15,3);
DECLARE VARIABLE ABERTOS NUMERIC(15,3);
DECLARE VARIABLE DATAABERTO TIMESTAMP;
DECLARE VARIABLE BLOQUEIO_DIAS INTEGER;
BEGIN

     /* BLOQUEIOS DO CLIENTE */
     SELECT
       CL.TIPO_BLOQUEIO,
       CL.TIPO_IMPEDIMENTO,
       CL.LIMITECREDITO
     FROM
       CLIENTES CL
     WHERE
       CL.CODIGO = :CODCLIENTE
     INTO
       :TIPO_BLOQUEIO,
       :TIPO_IMPEDIMENTO,
       :LIMITE;

     /* CLIENTE Ã BLOQUEADO? */
     IF (TIPO_BLOQUEIO = 'B') THEN
      BEGIN
        MENSAGEM = 'PESSOA PERMANENTEMENTE BLOQUEADA. IMPOSSÃVEL CONTINUAR.';
        BLOQUEIO = 'S';
        SUSPEND;
      END

     /* DEVO CALCULAR OUTROS BLOQUEIOS? */
     IF (TIPO_BLOQUEIO = 'A') THEN
      BEGIN

        /* TEM IMPEDIMENTOS? */
        IF (TIPO_IMPEDIMENTO <> 'N') THEN
         BEGIN
           MENSAGEM = 'PESSOA TEM IMPEDIMENTOS NO CADASTRO.';
           BLOQUEIO = 'A';
           SUSPEND;
         END

        /* LIMITE DE CRÃDITO NO FINANCEIRO */
        SELECT
          SUM(PA.VALOR)
        FROM
          PAGAMENTOS PA
        WHERE
          PA.ES = 2 AND
          PA.PAGO = 0 AND
          PA.CODCLIENTE = :CODCLIENTE AND
          PA.CODEMPRESA = :CODEMPRESA
        INTO
          :ABERTOS;

        IF (LIMITE < ABERTOS) THEN
         BEGIN
           MENSAGEM = 'FINANCEIRO A PRAZO EXCEDE O LIMITE DE CRÃDITO DA PESSOA';
           BLOQUEIO = 'A';
           SUSPEND;
         END

        /* DATA EM ABERTO */
        SELECT
          MIN(PA.DATAVENCIMENTO)
        FROM
          PAGAMENTOS PA
        WHERE
          PA.ES = 2 AND
          PA.PAGO = 0 AND
          PA.CODCLIENTE = :CODCLIENTE AND
          PA.CODEMPRESA = :CODEMPRESA
        INTO
          :DATAABERTO;

        SELECT
          SISCONFIG.BLOQUEIO_DIAS
        FROM
          SISCONFIG
        WHERE
          SISCONFIG.CODIGO = :CODEMPRESA
        INTO
          :BLOQUEIO_DIAS;

        IF (BLOQUEIO_DIAS < (CURRENT_DATE - CAST(DATAABERTO AS DATE))) THEN
         BEGIN
           MENSAGEM = 'PESSOA TEM DÃBITOS ANTERIORES NO FINANCEIRO';
           BLOQUEIO = 'A';
           SUSPEND;
         END

      END

     MENSAGEM = '';
     BLOQUEIO = 'N';
     SUSPEND;

END^


